        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000017": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000017",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><h2><a></a>CHAPTER I.<br>\nDown the Rabbit-Hole</h2></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000018": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000018",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000019": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000019",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice was beginning to get very tired of sitting by her sister on the bank, and of having nothing to do: once or twice she had peeped into the book her sister was reading, but it had no pictures or conversations in it, “and what is the use of a book,” thought Alice “without pictures or conversations?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000020": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000020",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000021": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000021",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>So she was considering in her own mind (as well as she could, for the hot day made her feel very sleepy and stupid), whether the pleasure of making a daisy-chain would be worth the trouble of getting up and picking the daisies, when suddenly a White Rabbit with pink eyes ran close by her.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000022": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000022",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000023": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000023",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>There was nothing so <i>very</i> remarkable in that; nor did Alice think it so <i>very</i> much out of the way to hear the Rabbit say to itself, “Oh dear! Oh dear! I shall be late!” (when she thought it over afterwards, it occurred to her that she ought to have wondered at this, but at the time it all seemed quite natural); but when the Rabbit actually <i>took a watch out of its waistcoat-pocket</i>, and looked at it, and then hurried on, Alice started to her feet, for it flashed across her mind that she had never before seen a rabbit with either a waistcoat-pocket, or a watch to take out of it, and burning with curiosity, she ran across the field after it, and fortunately was just in time to see it pop down a large rabbit-hole under the hedge.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000024": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000024",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000025": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000025",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>In another moment down went Alice after it, never once considering how in the world she was to get out again.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000026": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000026",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000027": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000027",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The rabbit-hole went straight on like a tunnel for some way, and then dipped suddenly down, so suddenly that Alice had not a moment to think about stopping herself before she found herself falling down a very deep well.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000028": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000028",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000029": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000029",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Either the well was very deep, or she fell very slowly, for she had plenty of time as she went down to look about her and to wonder what was going to happen next. First, she tried to look down and make out what she was coming to, but it was too dark to see anything; then she looked at the sides of the well, and noticed that they were filled with cupboards and book-shelves; here and there she saw maps and pictures hung upon pegs. She took down a jar from one of the shelves as she passed; it was labelled “ORANGE MARMALADE”, but to her great disappointment it was empty: she did not like to drop the jar for fear of killing somebody underneath, so managed to put it into one of the cupboards as she fell past it.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000030": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000030",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000031": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000031",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well!” thought Alice to herself, “after such a fall as this, I shall think nothing of tumbling down stairs! How brave they’ll all think me at home! Why, I wouldn’t say anything about it, even if I fell off the top of the house!” (Which was very likely true.)</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000032": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000032",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000033": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000033",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Down, down, down. Would the fall <i>never</i> come to an end? “I wonder how many miles I’ve fallen by this time?” she said aloud. “I must be getting somewhere near the centre of the earth. Let me see: that would be four thousand miles down, I think—” (for, you see, Alice had learnt several things of this sort in her lessons in the schoolroom, and though this was not a <i>very</i> good opportunity for showing off her knowledge, as there was no one to listen to her, still it was good practice to say it over) “—yes, that’s about the right distance—but then I wonder what Latitude or Longitude I’ve got to?” (Alice had no idea what Latitude was, or Longitude either, but thought they were nice grand words to say.)</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000034": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000034",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000035": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000035",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Presently she began again. “I wonder if I shall fall right <i>through</i> the earth! How funny it’ll seem to come out among the people that walk with their heads downward! The Antipathies, I think—” (she was rather glad there <i>was</i> no one listening, this time, as it didn’t sound at all the right word) “—but I shall have to ask them what the name of the country is, you know. Please, Ma’am, is this New Zealand or Australia?” (and she tried to curtsey as she spoke—fancy <i>curtseying</i> as you’re falling through the air! Do you think you could manage it?) “And what an ignorant little girl she’ll think me for asking! No, it’ll never do to ask: perhaps I shall see it written up somewhere.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000036": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000036",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000037": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000037",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Down, down, down. There was nothing else to do, so Alice soon began talking again. “Dinah’ll miss me very much to-night, I should think!” (Dinah was the cat.) “I hope they’ll remember her saucer of milk at tea-time. Dinah my dear! I wish you were down here with me! There are no mice in the air, I’m afraid, but you might catch a bat, and that’s very like a mouse, you know. But do cats eat bats, I wonder?” And here Alice began to get rather sleepy, and went on saying to herself, in a dreamy sort of way, “Do cats eat bats? Do cats eat bats?” and sometimes, “Do bats eat cats?” for, you see, as she couldn’t answer either question, it didn’t much matter which way she put it. She felt that she was dozing off, and had just begun to dream that she was walking hand in hand with Dinah, and saying to her very earnestly, “Now, Dinah, tell me the truth: did you ever eat a bat?” when suddenly, thump! thump! down she came upon a heap of sticks and dry leaves, and the fall was over.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000038": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000038",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000039": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000039",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice was not a bit hurt, and she jumped up on to her feet in a moment: she looked up, but it was all dark overhead; before her was another long passage, and the White Rabbit was still in sight, hurrying down it. There was not a moment to be lost: away went Alice like the wind, and was just in time to hear it say, as it turned a corner, “Oh my ears and whiskers, how late it’s getting!” She was close behind it when she turned the corner, but the Rabbit was no longer to be seen: she found herself in a long, low hall, which was lit up by a row of lamps hanging from the roof.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000040": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000040",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000041": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000041",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>There were doors all round the hall, but they were all locked; and when Alice had been all the way down one side and up the other, trying every door, she walked sadly down the middle, wondering how she was ever to get out again.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000042": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000042",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000043": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000043",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Suddenly she came upon a little three-legged table, all made of solid glass; there was nothing on it except a tiny golden key, and Alice’s first thought was that it might belong to one of the doors of the hall; but, alas! either the locks were too large, or the key was too small, but at any rate it would not open any of them. However, on the second time round, she came upon a low curtain she had not noticed before, and behind it was a little door about fifteen inches high: she tried the little golden key in the lock, and to her great delight it fitted!</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000044": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000044",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000045": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000045",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice opened the door and found that it led into a small passage, not much larger than a rat-hole: she knelt down and looked along the passage into the loveliest garden you ever saw. How she longed to get out of that dark hall, and wander about among those beds of bright flowers and those cool fountains, but she could not even get her head through the doorway; “and even if my head would go through,” thought poor Alice, “it would be of very little use without my shoulders. Oh, how I wish I could shut up like a telescope! I think I could, if I only knew how to begin.” For, you see, so many out-of-the-way things had happened lately, that Alice had begun to think that very few things indeed were really impossible.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000046": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000046",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000047": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000047",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>There seemed to be no use in waiting by the little door, so she went back to the table, half hoping she might find another key on it, or at any rate a book of rules for shutting people up like telescopes: this time she found a little bottle on it, (“which certainly was not here before,” said Alice,) and round the neck of the bottle was a paper label, with the words “DRINK ME,” beautifully printed on it in large letters.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000048": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000048",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000049": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000049",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>It was all very well to say “Drink me,” but the wise little Alice was not going to do <i>that</i> in a hurry. “No, I’ll look first,” she said, “and see whether it’s marked ‘<i>poison</i>’ or not”; for she had read several nice little histories about children who had got burnt, and eaten up by wild beasts and other unpleasant things, all because they <i>would</i> not remember the simple rules their friends had taught them: such as, that a red-hot poker will burn you if you hold it too long; and that if you cut your finger <i>very</i> deeply with a knife, it usually bleeds; and she had never forgotten that, if you drink much from a bottle marked “poison,” it is almost certain to disagree with you, sooner or later.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000050": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000050",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000051": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000051",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>However, this bottle was <i>not</i> marked “poison,” so Alice ventured to taste it, and finding it very nice, (it had, in fact, a sort of mixed flavour of cherry-tart, custard, pine-apple, roast turkey, toffee, and hot buttered toast,) she very soon finished it off.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000052": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000052",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000053": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000053",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"asterism\">*      *      *      *      *      *      *<br>\n<br>\n    *      *      *      *      *      *<br>\n<br>\n*      *      *      *      *      *      *<br></p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000054": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000054",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000055": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000055",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What a curious feeling!” said Alice; “I must be shutting up like a telescope.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000056": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000056",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000057": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000057",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>And so it was indeed: she was now only ten inches high, and her face brightened up at the thought that she was now the right size for going through the little door into that lovely garden. First, however, she waited for a few minutes to see if she was going to shrink any further: she felt a little nervous about this; “for it might end, you know,” said Alice to herself, “in my going out altogether, like a candle. I wonder what I should be like then?” And she tried to fancy what the flame of a candle is like after the candle is blown out, for she could not remember ever having seen such a thing.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000058": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000058",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000059": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000059",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>After a while, finding that nothing more happened, she decided on going into the garden at once; but, alas for poor Alice! when she got to the door, she found she had forgotten the little golden key, and when she went back to the table for it, she found she could not possibly reach it: she could see it quite plainly through the glass, and she tried her best to climb up one of the legs of the table, but it was too slippery; and when she had tired herself out with trying, the poor little thing sat down and cried.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000060": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000060",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000061": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000061",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Come, there’s no use in crying like that!” said Alice to herself, rather sharply; “I advise you to leave off this minute!” She generally gave herself very good advice, (though she very seldom followed it), and sometimes she scolded herself so severely as to bring tears into her eyes; and once she remembered trying to box her own ears for having cheated herself in a game of croquet she was playing against herself, for this curious child was very fond of pretending to be two people. “But it’s no use now,” thought poor Alice, “to pretend to be two people! Why, there’s hardly enough of me left to make <i>one</i> respectable person!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000062": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000062",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000063": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000063",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Soon her eye fell on a little glass box that was lying under the table: she opened it, and found in it a very small cake, on which the words “EAT ME” were beautifully marked in currants. “Well, I’ll eat it,” said Alice, “and if it makes me grow larger, I can reach the key; and if it makes me grow smaller, I can creep under the door; so either way I’ll get into the garden, and I don’t care which happens!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000064": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000064",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000065": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000065",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>She ate a little bit, and said anxiously to herself, “Which way? Which way?”, holding her hand on the top of her head to feel which way it was growing, and she was quite surprised to find that she remained the same size: to be sure, this generally happens when one eats cake, but Alice had got so much into the way of expecting nothing but out-of-the-way things to happen, that it seemed quite dull and stupid for life to go on in the common way.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000066": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000066",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000067": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000067",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>So she set to work, and very soon finished off the cake.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000068": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000068",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000069": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000069",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"asterism\">*      *      *      *      *      *      *<br>\n<br>\n    *      *      *      *      *      *<br>\n<br>\n*      *      *      *      *      *      *<br></p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000070": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000070",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000071": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000071",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000072": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000072",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><h2><a></a>CHAPTER II.<br>\nThe Pool of Tears</h2></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000073": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000073",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000074": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000074",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Curiouser and curiouser!” cried Alice (she was so much surprised, that for the moment she quite forgot how to speak good English); “now I’m opening out like the largest telescope that ever was! Good-bye, feet!” (for when she looked down at her feet, they seemed to be almost out of sight, they were getting so far off). “Oh, my poor little feet, I wonder who will put on your shoes and stockings for you now, dears? I’m sure <i>I</i> shan’t be able! I shall be a great deal too far off to trouble myself about you: you must manage the best way you can;—but I must be kind to them,” thought Alice, “or perhaps they won’t walk the way I want to go! Let me see: I’ll give them a new pair of boots every Christmas.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000075": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000075",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000076": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000076",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>And she went on planning to herself how she would manage it. “They must go by the carrier,” she thought; “and how funny it’ll seem, sending presents to one’s own feet! And how odd the directions will look!</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000077": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000077",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000078": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000078",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><div class=\"pgmonospaced\">     <i>Alice’s Right Foot, Esq.,\n<br>       Hearthrug,\n<br>         near the Fender,</i>           (<i>with Alice’s love</i>).\n<br></div></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000079": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000079",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000080": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000080",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"noindent\">Oh dear, what nonsense I’m talking!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000081": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000081",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000082": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000082",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Just then her head struck against the roof of the hall: in fact she was now more than nine feet high, and she at once took up the little golden key and hurried off to the garden door.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000083": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000083",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000084": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000084",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Poor Alice! It was as much as she could do, lying down on one side, to look through into the garden with one eye; but to get through was more hopeless than ever: she sat down and began to cry again.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000085": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000085",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000086": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000086",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You ought to be ashamed of yourself,” said Alice, “a great girl like you,” (she might well say this), “to go on crying in this way! Stop this moment, I tell you!” But she went on all the same, shedding gallons of tears, until there was a large pool all round her, about four inches deep and reaching half down the hall.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000087": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000087",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000088": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000088",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>After a time she heard a little pattering of feet in the distance, and she hastily dried her eyes to see what was coming. It was the White Rabbit returning, splendidly dressed, with a pair of white kid gloves in one hand and a large fan in the other: he came trotting along in a great hurry, muttering to himself as he came, “Oh! the Duchess, the Duchess! Oh! won’t she be savage if I’ve kept her waiting!” Alice felt so desperate that she was ready to ask help of any one; so, when the Rabbit came near her, she began, in a low, timid voice, “If you please, sir—” The Rabbit started violently, dropped the white kid gloves and the fan, and skurried away into the darkness as hard as he could go.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000089": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000089",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000090": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000090",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice took up the fan and gloves, and, as the hall was very hot, she kept fanning herself all the time she went on talking: “Dear, dear! How queer everything is to-day! And yesterday things went on just as usual. I wonder if I’ve been changed in the night? Let me think: was I the same when I got up this morning? I almost think I can remember feeling a little different. But if I’m not the same, the next question is, Who in the world am I? Ah, <i>that’s</i> the great puzzle!” And she began thinking over all the children she knew that were of the same age as herself, to see if she could have been changed for any of them.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000091": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000091",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000092": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000092",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’m sure I’m not Ada,” she said, “for her hair goes in such long ringlets, and mine doesn’t go in ringlets at all; and I’m sure I can’t be Mabel, for I know all sorts of things, and she, oh! she knows such a very little! Besides, <i>she’s</i> she, and <i>I’m</i> I, and—oh dear, how puzzling it all is! I’ll try if I know all the things I used to know. Let me see: four times five is twelve, and four times six is thirteen, and four times seven is—oh dear! I shall never get to twenty at that rate! However, the Multiplication Table doesn’t signify: let’s try Geography. London is the capital of Paris, and Paris is the capital of Rome, and Rome—no, <i>that’s</i> all wrong, I’m certain! I must have been changed for Mabel! I’ll try and say ‘<i>How doth the little</i>—’” and she crossed her hands on her lap as if she were saying lessons, and began to repeat it, but her voice sounded hoarse and strange, and the words did not come the same as they used to do:—</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000093": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000093",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000094": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000094",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"poem\">“How doth the little crocodile<br>\n    Improve his shining tail,<br>\nAnd pour the waters of the Nile<br>\n    On every golden scale!<br>\n<br>\n“How cheerfully he seems to grin,<br>\n    How neatly spread his claws,<br>\nAnd welcome little fishes in<br>\n    With gently smiling jaws!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000095": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000095",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000096": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000096",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’m sure those are not the right words,” said poor Alice, and her eyes filled with tears again as she went on, “I must be Mabel after all, and I shall have to go and live in that poky little house, and have next to no toys to play with, and oh! ever so many lessons to learn! No, I’ve made up my mind about it; if I’m Mabel, I’ll stay down here! It’ll be no use their putting their heads down and saying ‘Come up again, dear!’ I shall only look up and say ‘Who am I then? Tell me that first, and then, if I like being that person, I’ll come up: if not, I’ll stay down here till I’m somebody else’—but, oh dear!” cried Alice, with a sudden burst of tears, “I do wish they <i>would</i> put their heads down! I am so <i>very</i> tired of being all alone here!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000097": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000097",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000098": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000098",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>As she said this she looked down at her hands, and was surprised to see that she had put on one of the Rabbit’s little white kid gloves while she was talking. “How <i>can</i> I have done that?” she thought. “I must be growing small again.” She got up and went to the table to measure herself by it, and found that, as nearly as she could guess, she was now about two feet high, and was going on shrinking rapidly: she soon found out that the cause of this was the fan she was holding, and she dropped it hastily, just in time to avoid shrinking away altogether.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000099": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000099",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000100": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000100",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“That <i>was</i> a narrow escape!” said Alice, a good deal frightened at the sudden change, but very glad to find herself still in existence; “and now for the garden!” and she ran with all speed back to the little door: but, alas! the little door was shut again, and the little golden key was lying on the glass table as before, “and things are worse than ever,” thought the poor child, “for I never was so small as this before, never! And I declare it’s too bad, that it is!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000101": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000101",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000102": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000102",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>As she said these words her foot slipped, and in another moment, splash! she was up to her chin in salt water. Her first idea was that she had somehow fallen into the sea, “and in that case I can go back by railway,” she said to herself. (Alice had been to the seaside once in her life, and had come to the general conclusion, that wherever you go to on the English coast you find a number of bathing machines in the sea, some children digging in the sand with wooden spades, then a row of lodging houses, and behind them a railway station.) However, she soon made out that she was in the pool of tears which she had wept when she was nine feet high.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000103": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000103",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000104": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000104",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I wish I hadn’t cried so much!” said Alice, as she swam about, trying to find her way out. “I shall be punished for it now, I suppose, by being drowned in my own tears! That <i>will</i> be a queer thing, to be sure! However, everything is queer to-day.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000105": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000105",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000106": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000106",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Just then she heard something splashing about in the pool a little way off, and she swam nearer to make out what it was: at first she thought it must be a walrus or hippopotamus, but then she remembered how small she was now, and she soon made out that it was only a mouse that had slipped in like herself.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000107": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000107",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000108": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000108",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Would it be of any use, now,” thought Alice, “to speak to this mouse? Everything is so out-of-the-way down here, that I should think very likely it can talk: at any rate, there’s no harm in trying.” So she began: “O Mouse, do you know the way out of this pool? I am very tired of swimming about here, O Mouse!” (Alice thought this must be the right way of speaking to a mouse: she had never done such a thing before, but she remembered having seen in her brother’s Latin Grammar, “A mouse—of a mouse—to a mouse—a mouse—O mouse!”) The Mouse looked at her rather inquisitively, and seemed to her to wink with one of its little eyes, but it said nothing.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000109": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000109",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000110": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000110",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Perhaps it doesn’t understand English,” thought Alice; “I daresay it’s a French mouse, come over with William the Conqueror.” (For, with all her knowledge of history, Alice had no very clear notion how long ago anything had happened.) So she began again: “Où est ma chatte?” which was the first sentence in her French lesson-book. The Mouse gave a sudden leap out of the water, and seemed to quiver all over with fright. “Oh, I beg your pardon!” cried Alice hastily, afraid that she had hurt the poor animal’s feelings. “I quite forgot you didn’t like cats.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000111": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000111",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000112": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000112",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Not like cats!” cried the Mouse, in a shrill, passionate voice. “Would <i>you</i> like cats if you were me?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000113": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000113",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000114": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000114",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, perhaps not,” said Alice in a soothing tone: “don’t be angry about it. And yet I wish I could show you our cat Dinah: I think you’d take a fancy to cats if you could only see her. She is such a dear quiet thing,” Alice went on, half to herself, as she swam lazily about in the pool, “and she sits purring so nicely by the fire, licking her paws and washing her face—and she is such a nice soft thing to nurse—and she’s such a capital one for catching mice—oh, I beg your pardon!” cried Alice again, for this time the Mouse was bristling all over, and she felt certain it must be really offended. “We won’t talk about her any more if you’d rather not.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000115": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000115",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000116": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000116",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“We indeed!” cried the Mouse, who was trembling down to the end of his tail. “As if <i>I</i> would talk on such a subject! Our family always <i>hated</i> cats: nasty, low, vulgar things! Don’t let me hear the name again!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000117": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000117",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000118": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000118",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I won’t indeed!” said Alice, in a great hurry to change the subject of conversation. “Are you—are you fond—of—of dogs?” The Mouse did not answer, so Alice went on eagerly: “There is such a nice little dog near our house I should like to show you! A little bright-eyed terrier, you know, with oh, such long curly brown hair! And it’ll fetch things when you throw them, and it’ll sit up and beg for its dinner, and all sorts of things—I can’t remember half of them—and it belongs to a farmer, you know, and he says it’s so useful, it’s worth a hundred pounds! He says it kills all the rats and—oh dear!” cried Alice in a sorrowful tone, “I’m afraid I’ve offended it again!” For the Mouse was swimming away from her as hard as it could go, and making quite a commotion in the pool as it went.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000119": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000119",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000120": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000120",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>So she called softly after it, “Mouse dear! Do come back again, and we won’t talk about cats or dogs either, if you don’t like them!” When the Mouse heard this, it turned round and swam slowly back to her: its face was quite pale (with passion, Alice thought), and it said in a low trembling voice, “Let us get to the shore, and then I’ll tell you my history, and you’ll understand why it is I hate cats and dogs.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000121": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000121",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000122": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000122",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>It was high time to go, for the pool was getting quite crowded with the birds and animals that had fallen into it: there were a Duck and a Dodo, a Lory and an Eaglet, and several other curious creatures. Alice led the way, and the whole party swam to the shore.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000123": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000123",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000124": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000124",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000125": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000125",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><h2><a></a>CHAPTER III.<br>\nA Caucus-Race and a Long Tale</h2></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000126": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000126",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000127": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000127",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>They were indeed a queer-looking party that assembled on the bank—the birds with draggled feathers, the animals with their fur clinging close to them, and all dripping wet, cross, and uncomfortable.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000128": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000128",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000129": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000129",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The first question of course was, how to get dry again: they had a consultation about this, and after a few minutes it seemed quite natural to Alice to find herself talking familiarly with them, as if she had known them all her life. Indeed, she had quite a long argument with the Lory, who at last turned sulky, and would only say, “I am older than you, and must know better;” and this Alice would not allow without knowing how old it was, and, as the Lory positively refused to tell its age, there was no more to be said.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000130": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000130",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000131": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000131",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>At last the Mouse, who seemed to be a person of authority among them, called out, “Sit down, all of you, and listen to me! <i>I’ll</i> soon make you dry enough!” They all sat down at once, in a large ring, with the Mouse in the middle. Alice kept her eyes anxiously fixed on it, for she felt sure she would catch a bad cold if she did not get dry very soon.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000132": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000132",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000133": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000133",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Ahem!” said the Mouse with an important air, “are you all ready? This is the driest thing I know. Silence all round, if you please! ‘William the Conqueror, whose cause was favoured by the pope, was soon submitted to by the English, who wanted leaders, and had been of late much accustomed to usurpation and conquest. Edwin and Morcar, the earls of Mercia and Northumbria—’”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000134": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000134",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000135": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000135",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Ugh!” said the Lory, with a shiver.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000136": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000136",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000137": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000137",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I beg your pardon!” said the Mouse, frowning, but very politely: “Did you speak?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000138": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000138",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000139": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000139",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Not I!” said the Lory hastily.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000140": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000140",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000141": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000141",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I thought you did,” said the Mouse. “—I proceed. ‘Edwin and Morcar, the earls of Mercia and Northumbria, declared for him: and even Stigand, the patriotic archbishop of Canterbury, found it advisable—’”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000142": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000142",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000143": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000143",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Found <i>what</i>?” said the Duck.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000144": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000144",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000145": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000145",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Found <i>it</i>,” the Mouse replied rather crossly: “of course you know what ‘it’ means.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000146": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000146",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000147": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000147",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I know what ‘it’ means well enough, when <i>I</i> find a thing,” said the Duck: “it’s generally a frog or a worm. The question is, what did the archbishop find?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000148": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000148",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000149": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000149",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Mouse did not notice this question, but hurriedly went on, “‘—found it advisable to go with Edgar Atheling to meet William and offer him the crown. William’s conduct at first was moderate. But the insolence of his Normans—’ How are you getting on now, my dear?” it continued, turning to Alice as it spoke.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000150": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000150",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000151": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000151",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“As wet as ever,” said Alice in a melancholy tone: “it doesn’t seem to dry me at all.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000152": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000152",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000153": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000153",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“In that case,” said the Dodo solemnly, rising to its feet, “I move that the meeting adjourn, for the immediate adoption of more energetic remedies—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000154": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000154",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000155": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000155",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Speak English!” said the Eaglet. “I don’t know the meaning of half those long words, and, what’s more, I don’t believe you do either!” And the Eaglet bent down its head to hide a smile: some of the other birds tittered audibly.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000156": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000156",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000157": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000157",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What I was going to say,” said the Dodo in an offended tone, “was, that the best thing to get us dry would be a Caucus-race.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000158": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000158",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000159": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000159",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What <i>is</i> a Caucus-race?” said Alice; not that she wanted much to know, but the Dodo had paused as if it thought that <i>somebody</i> ought to speak, and no one else seemed inclined to say anything.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000160": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000160",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000161": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000161",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Why,” said the Dodo, “the best way to explain it is to do it.” (And, as you might like to try the thing yourself, some winter day, I will tell you how the Dodo managed it.)</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000162": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000162",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000163": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000163",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>First it marked out a race-course, in a sort of circle, (“the exact shape doesn’t matter,” it said,) and then all the party were placed along the course, here and there. There was no “One, two, three, and away,” but they began running when they liked, and left off when they liked, so that it was not easy to know when the race was over. However, when they had been running half an hour or so, and were quite dry again, the Dodo suddenly called out “The race is over!” and they all crowded round it, panting, and asking, “But who has won?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000164": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000164",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000165": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000165",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>This question the Dodo could not answer without a great deal of thought, and it sat for a long time with one finger pressed upon its forehead (the position in which you usually see Shakespeare, in the pictures of him), while the rest waited in silence. At last the Dodo said, “<i>Everybody</i> has won, and all must have prizes.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000166": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000166",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000167": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000167",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“But who is to give the prizes?” quite a chorus of voices asked.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000168": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000168",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000169": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000169",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Why, <i>she</i>, of course,” said the Dodo, pointing to Alice with one finger; and the whole party at once crowded round her, calling out in a confused way, “Prizes! Prizes!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000170": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000170",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000171": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000171",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice had no idea what to do, and in despair she put her hand in her pocket, and pulled out a box of comfits, (luckily the salt water had not got into it), and handed them round as prizes. There was exactly one a-piece, all round.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000172": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000172",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000173": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000173",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“But she must have a prize herself, you know,” said the Mouse.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000174": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000174",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000175": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000175",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Of course,” the Dodo replied very gravely. “What else have you got in your pocket?” he went on, turning to Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000176": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000176",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000177": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000177",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Only a thimble,” said Alice sadly.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000178": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000178",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000179": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000179",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Hand it over here,” said the Dodo.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000180": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000180",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000181": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000181",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Then they all crowded round her once more, while the Dodo solemnly presented the thimble, saying “We beg your acceptance of this elegant thimble;” and, when it had finished this short speech, they all cheered.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000182": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000182",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000183": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000183",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice thought the whole thing very absurd, but they all looked so grave that she did not dare to laugh; and, as she could not think of anything to say, she simply bowed, and took the thimble, looking as solemn as she could.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000184": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000184",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000185": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000185",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The next thing was to eat the comfits: this caused some noise and confusion, as the large birds complained that they could not taste theirs, and the small ones choked and had to be patted on the back. However, it was over at last, and they sat down again in a ring, and begged the Mouse to tell them something more.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000186": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000186",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000187": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000187",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You promised to tell me your history, you know,” said Alice, “and why it is you hate—C and D,” she added in a whisper, half afraid that it would be offended again.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000188": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000188",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000189": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000189",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Mine is a long and a sad tale!” said the Mouse, turning to Alice, and sighing.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000190": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000190",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000191": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000191",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It <i>is</i> a long tail, certainly,” said Alice, looking down with wonder at the Mouse’s tail; “but why do you call it sad?” And she kept on puzzling about it while the Mouse was speaking, so that her idea of the tale was something like this:—</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000192": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000192",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000193": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000193",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><div class=\"pgmonospaced\">         “Fury said to a\n<br>         mouse, That he\n<br>        met in the\n<br>       house,\n<br>     ‘Let us\n<br>      both go to\n<br>       law: <i>I</i> will\n<br>        prosecute\n<br>         <i>you</i>.—Come,\n<br>           I’ll take no\n<br>           denial; We\n<br>          must have a\n<br>        trial: For\n<br>      really this\n<br>     morning I’ve\n<br>    nothing\n<br>    to do.’\n<br>      Said the\n<br>      mouse to the\n<br>       cur, ‘Such\n<br>        a trial,\n<br>         dear sir,\n<br>            With\n<br>          no jury\n<br>        or judge,\n<br>       would be\n<br>      wasting\n<br>      our\n<br>      breath.’\n<br>        ‘I’ll be\n<br>        judge, I’ll\n<br>         be jury,’\n<br>             Said\n<br>         cunning\n<br>          old Fury:\n<br>          ‘I’ll\n<br>          try the\n<br>            whole\n<br>            cause,\n<br>              and\n<br>           condemn\n<br>           you\n<br>          to\n<br>           death.’”\n<br></div></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000194": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000194",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000195": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000195",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You are not attending!” said the Mouse to Alice severely. “What are you thinking of?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000196": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000196",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000197": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000197",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I beg your pardon,” said Alice very humbly: “you had got to the fifth bend, I think?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000198": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000198",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000199": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000199",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I had <i>not!</i>” cried the Mouse, sharply and very angrily.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000200": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000200",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000201": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000201",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“A knot!” said Alice, always ready to make herself useful, and looking anxiously about her. “Oh, do let me help to undo it!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000202": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000202",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000203": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000203",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I shall do nothing of the sort,” said the Mouse, getting up and walking away. “You insult me by talking such nonsense!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000204": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000204",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000205": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000205",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I didn’t mean it!” pleaded poor Alice. “But you’re so easily offended, you know!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000206": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000206",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000207": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000207",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Mouse only growled in reply.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000208": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000208",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000209": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000209",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Please come back and finish your story!” Alice called after it; and the others all joined in chorus, “Yes, please do!” but the Mouse only shook its head impatiently, and walked a little quicker.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000210": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000210",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000211": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000211",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What a pity it wouldn’t stay!” sighed the Lory, as soon as it was quite out of sight; and an old Crab took the opportunity of saying to her daughter “Ah, my dear! Let this be a lesson to you never to lose <i>your</i> temper!” “Hold your tongue, Ma!” said the young Crab, a little snappishly. “You’re enough to try the patience of an oyster!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000212": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000212",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000213": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000213",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I wish I had our Dinah here, I know I do!” said Alice aloud, addressing nobody in particular. “She’d soon fetch it back!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000214": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000214",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000215": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000215",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“And who is Dinah, if I might venture to ask the question?” said the Lory.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000216": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000216",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000217": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000217",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice replied eagerly, for she was always ready to talk about her pet: “Dinah’s our cat. And she’s such a capital one for catching mice you can’t think! And oh, I wish you could see her after the birds! Why, she’ll eat a little bird as soon as look at it!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000218": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000218",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000219": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000219",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>This speech caused a remarkable sensation among the party. Some of the birds hurried off at once: one old Magpie began wrapping itself up very carefully, remarking, “I really must be getting home; the night-air doesn’t suit my throat!” and a Canary called out in a trembling voice to its children, “Come away, my dears! It’s high time you were all in bed!” On various pretexts they all moved off, and Alice was soon left alone.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000220": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000220",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000221": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000221",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I wish I hadn’t mentioned Dinah!” she said to herself in a melancholy tone. “Nobody seems to like her, down here, and I’m sure she’s the best cat in the world! Oh, my dear Dinah! I wonder if I shall ever see you any more!” And here poor Alice began to cry again, for she felt very lonely and low-spirited. In a little while, however, she again heard a little pattering of footsteps in the distance, and she looked up eagerly, half hoping that the Mouse had changed his mind, and was coming back to finish his story.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000222": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000222",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000223": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000223",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000224": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000224",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><h2><a></a>CHAPTER IV.<br>\nThe Rabbit Sends in a Little Bill</h2></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000225": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000225",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000226": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000226",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>It was the White Rabbit, trotting slowly back again, and looking anxiously about as it went, as if it had lost something; and she heard it muttering to itself “The Duchess! The Duchess! Oh my dear paws! Oh my fur and whiskers! She’ll get me executed, as sure as ferrets are ferrets! Where <i>can</i> I have dropped them, I wonder?” Alice guessed in a moment that it was looking for the fan and the pair of white kid gloves, and she very good-naturedly began hunting about for them, but they were nowhere to be seen—everything seemed to have changed since her swim in the pool, and the great hall, with the glass table and the little door, had vanished completely.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000227": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000227",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000228": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000228",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Very soon the Rabbit noticed Alice, as she went hunting about, and called out to her in an angry tone, “Why, Mary Ann, what <i>are</i> you doing out here? Run home this moment, and fetch me a pair of gloves and a fan! Quick, now!” And Alice was so much frightened that she ran off at once in the direction it pointed to, without trying to explain the mistake it had made.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000229": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000229",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000230": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000230",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“He took me for his housemaid,” she said to herself as she ran. “How surprised he’ll be when he finds out who I am! But I’d better take him his fan and gloves—that is, if I can find them.” As she said this, she came upon a neat little house, on the door of which was a bright brass plate with the name “W. RABBIT,” engraved upon it. She went in without knocking, and hurried upstairs, in great fear lest she should meet the real Mary Ann, and be turned out of the house before she had found the fan and gloves.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000231": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000231",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000232": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000232",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“How queer it seems,” Alice said to herself, “to be going messages for a rabbit! I suppose Dinah’ll be sending me on messages next!” And she began fancying the sort of thing that would happen: “‘Miss Alice! Come here directly, and get ready for your walk!’ ‘Coming in a minute, nurse! But I’ve got to see that the mouse doesn’t get out.’ Only I don’t think,” Alice went on, “that they’d let Dinah stop in the house if it began ordering people about like that!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000233": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000233",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000234": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000234",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>By this time she had found her way into a tidy little room with a table in the window, and on it (as she had hoped) a fan and two or three pairs of tiny white kid gloves: she took up the fan and a pair of the gloves, and was just going to leave the room, when her eye fell upon a little bottle that stood near the looking-glass. There was no label this time with the words “DRINK ME,” but nevertheless she uncorked it and put it to her lips. “I know <i>something</i> interesting is sure to happen,” she said to herself, “whenever I eat or drink anything; so I’ll just see what this bottle does. I do hope it’ll make me grow large again, for really I’m quite tired of being such a tiny little thing!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000235": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000235",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000236": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000236",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>It did so indeed, and much sooner than she had expected: before she had drunk half the bottle, she found her head pressing against the ceiling, and had to stoop to save her neck from being broken. She hastily put down the bottle, saying to herself “That’s quite enough—I hope I shan’t grow any more—As it is, I can’t get out at the door—I do wish I hadn’t drunk quite so much!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000237": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000237",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000238": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000238",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alas! it was too late to wish that! She went on growing, and growing, and very soon had to kneel down on the floor: in another minute there was not even room for this, and she tried the effect of lying down with one elbow against the door, and the other arm curled round her head. Still she went on growing, and, as a last resource, she put one arm out of the window, and one foot up the chimney, and said to herself “Now I can do no more, whatever happens. What <i>will</i> become of me?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000239": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000239",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000240": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000240",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Luckily for Alice, the little magic bottle had now had its full effect, and she grew no larger: still it was very uncomfortable, and, as there seemed to be no sort of chance of her ever getting out of the room again, no wonder she felt unhappy.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000241": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000241",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000242": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000242",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It was much pleasanter at home,” thought poor Alice, “when one wasn’t always growing larger and smaller, and being ordered about by mice and rabbits. I almost wish I hadn’t gone down that rabbit-hole—and yet—and yet—it’s rather curious, you know, this sort of life! I do wonder what <i>can</i> have happened to me! When I used to read fairy-tales, I fancied that kind of thing never happened, and now here I am in the middle of one! There ought to be a book written about me, that there ought! And when I grow up, I’ll write one—but I’m grown up now,” she added in a sorrowful tone; “at least there’s no room to grow up any more <i>here</i>.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000243": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000243",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000244": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000244",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“But then,” thought Alice, “shall I <i>never</i> get any older than I am now? That’ll be a comfort, one way—never to be an old woman—but then—always to have lessons to learn! Oh, I shouldn’t like <i>that!</i>”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000245": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000245",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000246": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000246",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Oh, you foolish Alice!” she answered herself. “How can you learn lessons in here? Why, there’s hardly room for <i>you</i>, and no room at all for any lesson-books!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000247": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000247",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000248": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000248",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>And so she went on, taking first one side and then the other, and making quite a conversation of it altogether; but after a few minutes she heard a voice outside, and stopped to listen.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000249": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000249",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000250": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000250",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Mary Ann! Mary Ann!” said the voice. “Fetch me my gloves this moment!” Then came a little pattering of feet on the stairs. Alice knew it was the Rabbit coming to look for her, and she trembled till she shook the house, quite forgetting that she was now about a thousand times as large as the Rabbit, and had no reason to be afraid of it.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000251": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000251",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000252": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000252",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Presently the Rabbit came up to the door, and tried to open it; but, as the door opened inwards, and Alice’s elbow was pressed hard against it, that attempt proved a failure. Alice heard it say to itself “Then I’ll go round and get in at the window.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000253": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000253",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000254": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000254",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“<i>That</i> you won’t!” thought Alice, and, after waiting till she fancied she heard the Rabbit just under the window, she suddenly spread out her hand, and made a snatch in the air. She did not get hold of anything, but she heard a little shriek and a fall, and a crash of broken glass, from which she concluded that it was just possible it had fallen into a cucumber-frame, or something of the sort.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000255": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000255",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000256": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000256",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Next came an angry voice—the Rabbit’s—“Pat! Pat! Where are you?” And then a voice she had never heard before, “Sure then I’m here! Digging for apples, yer honour!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000257": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000257",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000258": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000258",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Digging for apples, indeed!” said the Rabbit angrily. “Here! Come and help me out of <i>this!</i>” (Sounds of more broken glass.)</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000259": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000259",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000260": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000260",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Now tell me, Pat, what’s that in the window?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000261": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000261",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000262": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000262",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Sure, it’s an arm, yer honour!” (He pronounced it “arrum.”)</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000263": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000263",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000264": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000264",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“An arm, you goose! Who ever saw one that size? Why, it fills the whole window!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000265": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000265",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000266": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000266",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Sure, it does, yer honour: but it’s an arm for all that.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000267": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000267",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000268": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000268",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, it’s got no business there, at any rate: go and take it away!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000269": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000269",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000270": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000270",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>There was a long silence after this, and Alice could only hear whispers now and then; such as, “Sure, I don’t like it, yer honour, at all, at all!” “Do as I tell you, you coward!” and at last she spread out her hand again, and made another snatch in the air. This time there were <i>two</i> little shrieks, and more sounds of broken glass. “What a number of cucumber-frames there must be!” thought Alice. “I wonder what they’ll do next! As for pulling me out of the window, I only wish they <i>could!</i> I’m sure <i>I</i> don’t want to stay in here any longer!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000271": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000271",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000272": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000272",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>She waited for some time without hearing anything more: at last came a rumbling of little cartwheels, and the sound of a good many voices all talking together: she made out the words: “Where’s the other ladder?—Why, I hadn’t to bring but one; Bill’s got the other—Bill! fetch it here, lad!—Here, put ’em up at this corner—No, tie ’em together first—they don’t reach half high enough yet—Oh! they’ll do well enough; don’t be particular—Here, Bill! catch hold of this rope—Will the roof bear?—Mind that loose slate—Oh, it’s coming down! Heads below!” (a loud crash)—“Now, who did that?—It was Bill, I fancy—Who’s to go down the chimney?—Nay, <i>I</i> shan’t! <i>You</i> do it!—<i>That</i> I won’t, then!—Bill’s to go down—Here, Bill! the master says you’re to go down the chimney!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000273": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000273",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000274": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000274",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Oh! So Bill’s got to come down the chimney, has he?” said Alice to herself. “Shy, they seem to put everything upon Bill! I wouldn’t be in Bill’s place for a good deal: this fireplace is narrow, to be sure; but I <i>think</i> I can kick a little!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000275": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000275",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000276": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000276",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>She drew her foot as far down the chimney as she could, and waited till she heard a little animal (she couldn’t guess of what sort it was) scratching and scrambling about in the chimney close above her: then, saying to herself “This is Bill,” she gave one sharp kick, and waited to see what would happen next.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000277": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000277",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000278": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000278",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The first thing she heard was a general chorus of “There goes Bill!” then the Rabbit’s voice along—“Catch him, you by the hedge!” then silence, and then another confusion of voices—“Hold up his head—Brandy now—Don’t choke him—How was it, old fellow? What happened to you? Tell us all about it!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000279": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000279",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000280": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000280",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Last came a little feeble, squeaking voice, (“That’s Bill,” thought Alice,) “Well, I hardly know—No more, thank ye; I’m better now—but I’m a deal too flustered to tell you—all I know is, something comes at me like a Jack-in-the-box, and up I goes like a sky-rocket!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000281": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000281",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000282": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000282",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“So you did, old fellow!” said the others.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000283": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000283",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000284": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000284",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“We must burn the house down!” said the Rabbit’s voice; and Alice called out as loud as she could, “If you do, I’ll set Dinah at you!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000285": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000285",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000286": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000286",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>There was a dead silence instantly, and Alice thought to herself, “I wonder what they <i>will</i> do next! If they had any sense, they’d take the roof off.” After a minute or two, they began moving about again, and Alice heard the Rabbit say, “A barrowful will do, to begin with.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000287": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000287",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000288": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000288",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“A barrowful of <i>what?</i>” thought Alice; but she had not long to doubt, for the next moment a shower of little pebbles came rattling in at the window, and some of them hit her in the face. “I’ll put a stop to this,” she said to herself, and shouted out, “You’d better not do that again!” which produced another dead silence.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000289": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000289",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000290": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000290",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice noticed with some surprise that the pebbles were all turning into little cakes as they lay on the floor, and a bright idea came into her head. “If I eat one of these cakes,” she thought, “it’s sure to make <i>some</i> change in my size; and as it can’t possibly make me larger, it must make me smaller, I suppose.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000291": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000291",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000292": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000292",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>So she swallowed one of the cakes, and was delighted to find that she began shrinking directly. As soon as she was small enough to get through the door, she ran out of the house, and found quite a crowd of little animals and birds waiting outside. The poor little Lizard, Bill, was in the middle, being held up by two guinea-pigs, who were giving it something out of a bottle. They all made a rush at Alice the moment she appeared; but she ran off as hard as she could, and soon found herself safe in a thick wood.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000293": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000293",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000294": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000294",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“The first thing I’ve got to do,” said Alice to herself, as she wandered about in the wood, “is to grow to my right size again; and the second thing is to find my way into that lovely garden. I think that will be the best plan.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000295": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000295",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000296": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000296",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>It sounded an excellent plan, no doubt, and very neatly and simply arranged; the only difficulty was, that she had not the smallest idea how to set about it; and while she was peering about anxiously among the trees, a little sharp bark just over her head made her look up in a great hurry.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000297": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000297",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000298": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000298",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>An enormous puppy was looking down at her with large round eyes, and feebly stretching out one paw, trying to touch her. “Poor little thing!” said Alice, in a coaxing tone, and she tried hard to whistle to it; but she was terribly frightened all the time at the thought that it might be hungry, in which case it would be very likely to eat her up in spite of all her coaxing.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000299": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000299",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000300": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000300",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Hardly knowing what she did, she picked up a little bit of stick, and held it out to the puppy; whereupon the puppy jumped into the air off all its feet at once, with a yelp of delight, and rushed at the stick, and made believe to worry it; then Alice dodged behind a great thistle, to keep herself from being run over; and the moment she appeared on the other side, the puppy made another rush at the stick, and tumbled head over heels in its hurry to get hold of it; then Alice, thinking it was very like having a game of play with a cart-horse, and expecting every moment to be trampled under its feet, ran round the thistle again; then the puppy began a series of short charges at the stick, running a very little way forwards each time and a long way back, and barking hoarsely all the while, till at last it sat down a good way off, panting, with its tongue hanging out of its mouth, and its great eyes half shut.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000301": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000301",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000302": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000302",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>This seemed to Alice a good opportunity for making her escape; so she set off at once, and ran till she was quite tired and out of breath, and till the puppy’s bark sounded quite faint in the distance.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000303": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000303",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000304": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000304",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“And yet what a dear little puppy it was!” said Alice, as she leant against a buttercup to rest herself, and fanned herself with one of the leaves: “I should have liked teaching it tricks very much, if—if I’d only been the right size to do it! Oh dear! I’d nearly forgotten that I’ve got to grow up again! Let me see—how <i>is</i> it to be managed? I suppose I ought to eat or drink something or other; but the great question is, what?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000305": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000305",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000306": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000306",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The great question certainly was, what? Alice looked all round her at the flowers and the blades of grass, but she did not see anything that looked like the right thing to eat or drink under the circumstances. There was a large mushroom growing near her, about the same height as herself; and when she had looked under it, and on both sides of it, and behind it, it occurred to her that she might as well look and see what was on the top of it.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000307": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000307",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000308": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000308",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>She stretched herself up on tiptoe, and peeped over the edge of the mushroom, and her eyes immediately met those of a large blue caterpillar, that was sitting on the top with its arms folded, quietly smoking a long hookah, and taking not the smallest notice of her or of anything else.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000309": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000309",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000310": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000310",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000311": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000311",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><h2><a></a>CHAPTER V.<br>\nAdvice from a Caterpillar</h2></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000312": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000312",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000313": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000313",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Caterpillar and Alice looked at each other for some time in silence: at last the Caterpillar took the hookah out of its mouth, and addressed her in a languid, sleepy voice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000314": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000314",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000315": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000315",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Who are <i>you?</i>” said the Caterpillar.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000316": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000316",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000317": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000317",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>This was not an encouraging opening for a conversation. Alice replied, rather shyly, “I—I hardly know, sir, just at present—at least I know who I <i>was</i> when I got up this morning, but I think I must have been changed several times since then.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000318": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000318",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000319": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000319",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What do you mean by that?” said the Caterpillar sternly. “Explain yourself!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000320": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000320",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000321": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000321",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I can’t explain <i>myself</i>, I’m afraid, sir,” said Alice, “because I’m not myself, you see.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000322": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000322",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000323": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000323",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I don’t see,” said the Caterpillar.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000324": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000324",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000325": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000325",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’m afraid I can’t put it more clearly,” Alice replied very politely, “for I can’t understand it myself to begin with; and being so many different sizes in a day is very confusing.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000326": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000326",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000327": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000327",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It isn’t,” said the Caterpillar.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000328": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000328",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000329": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000329",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, perhaps you haven’t found it so yet,” said Alice; “but when you have to turn into a chrysalis—you will some day, you know—and then after that into a butterfly, I should think you’ll feel it a little queer, won’t you?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000330": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000330",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000331": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000331",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Not a bit,” said the Caterpillar.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000332": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000332",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000333": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000333",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, perhaps your feelings may be different,” said Alice; “all I know is, it would feel very queer to <i>me</i>.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000334": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000334",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000335": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000335",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You!” said the Caterpillar contemptuously. “Who are <i>you?</i>”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000336": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000336",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000337": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000337",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Which brought them back again to the beginning of the conversation. Alice felt a little irritated at the Caterpillar’s making such <i>very</i> short remarks, and she drew herself up and said, very gravely, “I think, you ought to tell me who <i>you</i> are, first.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000338": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000338",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000339": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000339",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Why?” said the Caterpillar.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000340": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000340",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000341": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000341",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Here was another puzzling question; and as Alice could not think of any good reason, and as the Caterpillar seemed to be in a <i>very</i> unpleasant state of mind, she turned away.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000342": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000342",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000343": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000343",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Come back!” the Caterpillar called after her. “I’ve something important to say!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000344": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000344",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000345": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000345",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>This sounded promising, certainly: Alice turned and came back again.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000346": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000346",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000347": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000347",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Keep your temper,” said the Caterpillar.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000348": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000348",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000349": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000349",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Is that all?” said Alice, swallowing down her anger as well as she could.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000350": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000350",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000351": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000351",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“No,” said the Caterpillar.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000352": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000352",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000353": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000353",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice thought she might as well wait, as she had nothing else to do, and perhaps after all it might tell her something worth hearing. For some minutes it puffed away without speaking, but at last it unfolded its arms, took the hookah out of its mouth again, and said, “So you think you’re changed, do you?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000354": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000354",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000355": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000355",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’m afraid I am, sir,” said Alice; “I can’t remember things as I used—and I don’t keep the same size for ten minutes together!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000356": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000356",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000357": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000357",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Can’t remember <i>what</i> things?” said the Caterpillar.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000358": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000358",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000359": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000359",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, I’ve tried to say “How doth the little busy bee,” but it all came different!” Alice replied in a very melancholy voice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000360": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000360",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000361": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000361",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Repeat, “<i>You are old, Father William</i>,’” said the Caterpillar.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000362": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000362",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000363": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000363",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice folded her hands, and began:—</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000364": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000364",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000365": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000365",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"poem\">“You are old, Father William,” the young man said,<br>\n    “And your hair has become very white;<br>\nAnd yet you incessantly stand on your head—<br>\n    Do you think, at your age, it is right?”<br>\n<br>\n“In my youth,” Father William replied to his son,<br>\n    “I feared it might injure the brain;<br>\nBut, now that I’m perfectly sure I have none,<br>\n    Why, I do it again and again.”<br>\n<br>\n“You are old,” said the youth, “as I mentioned before,<br>\n    And have grown most uncommonly fat;<br>\nYet you turned a back-somersault in at the door—<br>\n    Pray, what is the reason of that?”<br>\n<br>\n“In my youth,” said the sage, as he shook his grey locks,<br>\n    “I kept all my limbs very supple<br>\nBy the use of this ointment—one shilling the box—<br>\n    Allow me to sell you a couple?”<br>\n<br>\n“You are old,” said the youth, “and your jaws are too weak<br>\n    For anything tougher than suet;<br>\nYet you finished the goose, with the bones and the beak—<br>\n    Pray, how did you manage to do it?”<br>\n<br>\n“In my youth,” said his father, “I took to the law,<br>\n    And argued each case with my wife;<br>\nAnd the muscular strength, which it gave to my jaw,<br>\n    Has lasted the rest of my life.”<br>\n<br>\n“You are old,” said the youth, “one would hardly suppose<br>\n    That your eye was as steady as ever;<br>\nYet you balanced an eel on the end of your nose—<br>\n    What made you so awfully clever?”<br>\n<br>\n“I have answered three questions, and that is enough,”<br>\n    Said his father; “don’t give yourself airs!<br>\nDo you think I can listen all day to such stuff?<br>\n    Be off, or I’ll kick you down stairs!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000366": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000366",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000367": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000367",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“That is not said right,” said the Caterpillar.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000368": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000368",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000369": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000369",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Not <i>quite</i> right, I’m afraid,” said Alice, timidly; “some of the words have got altered.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000370": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000370",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000371": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000371",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It is wrong from beginning to end,” said the Caterpillar decidedly, and there was silence for some minutes.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000372": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000372",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000373": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000373",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Caterpillar was the first to speak.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000374": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000374",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000375": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000375",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What size do you want to be?” it asked.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000376": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000376",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000377": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000377",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Oh, I’m not particular as to size,” Alice hastily replied; “only one doesn’t like changing so often, you know.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000378": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000378",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000379": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000379",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I <i>don’t</i> know,” said the Caterpillar.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000380": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000380",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000381": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000381",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice said nothing: she had never been so much contradicted in her life before, and she felt that she was losing her temper.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000382": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000382",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000383": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000383",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Are you content now?” said the Caterpillar.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000384": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000384",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000385": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000385",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, I should like to be a <i>little</i> larger, sir, if you wouldn’t mind,” said Alice: “three inches is such a wretched height to be.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000386": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000386",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000387": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000387",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It is a very good height indeed!” said the Caterpillar angrily, rearing itself upright as it spoke (it was exactly three inches high).</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000388": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000388",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000389": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000389",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“But I’m not used to it!” pleaded poor Alice in a piteous tone. And she thought of herself, “I wish the creatures wouldn’t be so easily offended!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000390": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000390",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000391": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000391",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You’ll get used to it in time,” said the Caterpillar; and it put the hookah into its mouth and began smoking again.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000392": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000392",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000393": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000393",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>This time Alice waited patiently until it chose to speak again. In a minute or two the Caterpillar took the hookah out of its mouth and yawned once or twice, and shook itself. Then it got down off the mushroom, and crawled away in the grass, merely remarking as it went, “One side will make you grow taller, and the other side will make you grow shorter.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000394": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000394",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000395": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000395",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“One side of <i>what?</i> The other side of <i>what?</i>” thought Alice to herself.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000396": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000396",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000397": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000397",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Of the mushroom,” said the Caterpillar, just as if she had asked it aloud; and in another moment it was out of sight.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000398": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000398",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000399": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000399",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice remained looking thoughtfully at the mushroom for a minute, trying to make out which were the two sides of it; and as it was perfectly round, she found this a very difficult question. However, at last she stretched her arms round it as far as they would go, and broke off a bit of the edge with each hand.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000400": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000400",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000401": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000401",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“And now which is which?” she said to herself, and nibbled a little of the right-hand bit to try the effect: the next moment she felt a violent blow underneath her chin: it had struck her foot!</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000402": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000402",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000403": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000403",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>She was a good deal frightened by this very sudden change, but she felt that there was no time to be lost, as she was shrinking rapidly; so she set to work at once to eat some of the other bit. Her chin was pressed so closely against her foot, that there was hardly room to open her mouth; but she did it at last, and managed to swallow a morsel of the lefthand bit.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000404": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000404",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000405": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000405",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"asterism\">*      *      *      *      *      *      *<br>\n<br>\n    *      *      *      *      *      *<br>\n<br>\n*      *      *      *      *      *      *<br></p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000406": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000406",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000407": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000407",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Come, my head’s free at last!” said Alice in a tone of delight, which changed into alarm in another moment, when she found that her shoulders were nowhere to be found: all she could see, when she looked down, was an immense length of neck, which seemed to rise like a stalk out of a sea of green leaves that lay far below her.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000408": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000408",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000409": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000409",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What <i>can</i> all that green stuff be?” said Alice. “And where <i>have</i> my shoulders got to? And oh, my poor hands, how is it I can’t see you?” She was moving them about as she spoke, but no result seemed to follow, except a little shaking among the distant green leaves.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000410": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000410",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000411": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000411",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>As there seemed to be no chance of getting her hands up to her head, she tried to get her head down to them, and was delighted to find that her neck would bend about easily in any direction, like a serpent. She had just succeeded in curving it down into a graceful zigzag, and was going to dive in among the leaves, which she found to be nothing but the tops of the trees under which she had been wandering, when a sharp hiss made her draw back in a hurry: a large pigeon had flown into her face, and was beating her violently with its wings.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000412": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000412",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000413": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000413",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Serpent!” screamed the Pigeon.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000414": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000414",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000415": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000415",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’m <i>not</i> a serpent!” said Alice indignantly. “Let me alone!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000416": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000416",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000417": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000417",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Serpent, I say again!” repeated the Pigeon, but in a more subdued tone, and added with a kind of sob, “I’ve tried every way, and nothing seems to suit them!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000418": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000418",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000419": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000419",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I haven’t the least idea what you’re talking about,” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000420": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000420",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000421": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000421",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’ve tried the roots of trees, and I’ve tried banks, and I’ve tried hedges,” the Pigeon went on, without attending to her; “but those serpents! There’s no pleasing them!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000422": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000422",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000423": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000423",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice was more and more puzzled, but she thought there was no use in saying anything more till the Pigeon had finished.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000424": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000424",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000425": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000425",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“As if it wasn’t trouble enough hatching the eggs,” said the Pigeon; “but I must be on the look-out for serpents night and day! Why, I haven’t had a wink of sleep these three weeks!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000426": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000426",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000427": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000427",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’m very sorry you’ve been annoyed,” said Alice, who was beginning to see its meaning.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000428": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000428",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000429": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000429",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“And just as I’d taken the highest tree in the wood,” continued the Pigeon, raising its voice to a shriek, “and just as I was thinking I should be free of them at last, they must needs come wriggling down from the sky! Ugh, Serpent!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000430": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000430",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000431": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000431",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“But I’m <i>not</i> a serpent, I tell you!” said Alice. “I’m a—I’m a—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000432": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000432",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000433": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000433",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well! <i>What</i> are you?” said the Pigeon. “I can see you’re trying to invent something!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000434": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000434",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000435": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000435",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I—I’m a little girl,” said Alice, rather doubtfully, as she remembered the number of changes she had gone through that day.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000436": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000436",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000437": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000437",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“A likely story indeed!” said the Pigeon in a tone of the deepest contempt. “I’ve seen a good many little girls in my time, but never <i>one</i> with such a neck as that! No, no! You’re a serpent; and there’s no use denying it. I suppose you’ll be telling me next that you never tasted an egg!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000438": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000438",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000439": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000439",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I <i>have</i> tasted eggs, certainly,” said Alice, who was a very truthful child; “but little girls eat eggs quite as much as serpents do, you know.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000440": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000440",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000441": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000441",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I don’t believe it,” said the Pigeon; “but if they do, why then they’re a kind of serpent, that’s all I can say.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000442": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000442",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000443": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000443",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>This was such a new idea to Alice, that she was quite silent for a minute or two, which gave the Pigeon the opportunity of adding, “You’re looking for eggs, I know <i>that</i> well enough; and what does it matter to me whether you’re a little girl or a serpent?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000444": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000444",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000445": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000445",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It matters a good deal to <i>me</i>,” said Alice hastily; “but I’m not looking for eggs, as it happens; and if I was, I shouldn’t want <i>yours</i>: I don’t like them raw.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000446": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000446",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000447": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000447",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, be off, then!” said the Pigeon in a sulky tone, as it settled down again into its nest. Alice crouched down among the trees as well as she could, for her neck kept getting entangled among the branches, and every now and then she had to stop and untwist it. After a while she remembered that she still held the pieces of mushroom in her hands, and she set to work very carefully, nibbling first at one and then at the other, and growing sometimes taller and sometimes shorter, until she had succeeded in bringing herself down to her usual height.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000448": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000448",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000449": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000449",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>It was so long since she had been anything near the right size, that it felt quite strange at first; but she got used to it in a few minutes, and began talking to herself, as usual. “Come, there’s half my plan done now! How puzzling all these changes are! I’m never sure what I’m going to be, from one minute to another! However, I’ve got back to my right size: the next thing is, to get into that beautiful garden—how <i>is</i> that to be done, I wonder?” As she said this, she came suddenly upon an open place, with a little house in it about four feet high. “Whoever lives there,” thought Alice, “it’ll never do to come upon them <i>this</i> size: why, I should frighten them out of their wits!” So she began nibbling at the righthand bit again, and did not venture to go near the house till she had brought herself down to nine inches high.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000450": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000450",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000451": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000451",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000452": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000452",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><h2><a></a>CHAPTER VI.<br>\nPig and Pepper</h2></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000453": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000453",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000454": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000454",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>For a minute or two she stood looking at the house, and wondering what to do next, when suddenly a footman in livery came running out of the wood—(she considered him to be a footman because he was in livery: otherwise, judging by his face only, she would have called him a fish)—and rapped loudly at the door with his knuckles. It was opened by another footman in livery, with a round face, and large eyes like a frog; and both footmen, Alice noticed, had powdered hair that curled all over their heads. She felt very curious to know what it was all about, and crept a little way out of the wood to listen.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000455": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000455",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000456": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000456",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Fish-Footman began by producing from under his arm a great letter, nearly as large as himself, and this he handed over to the other, saying, in a solemn tone, “For the Duchess. An invitation from the Queen to play croquet.” The Frog-Footman repeated, in the same solemn tone, only changing the order of the words a little, “From the Queen. An invitation for the Duchess to play croquet.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000457": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000457",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000458": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000458",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Then they both bowed low, and their curls got entangled together.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000459": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000459",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000460": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000460",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice laughed so much at this, that she had to run back into the wood for fear of their hearing her; and when she next peeped out the Fish-Footman was gone, and the other was sitting on the ground near the door, staring stupidly up into the sky.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000461": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000461",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000462": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000462",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice went timidly up to the door, and knocked.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000463": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000463",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000464": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000464",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“There’s no sort of use in knocking,” said the Footman, “and that for two reasons. First, because I’m on the same side of the door as you are; secondly, because they’re making such a noise inside, no one could possibly hear you.” And certainly there <i>was</i> a most extraordinary noise going on within—a constant howling and sneezing, and every now and then a great crash, as if a dish or kettle had been broken to pieces.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000465": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000465",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000466": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000466",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Please, then,” said Alice, “how am I to get in?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000467": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000467",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000468": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000468",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“There might be some sense in your knocking,” the Footman went on without attending to her, “if we had the door between us. For instance, if you were <i>inside</i>, you might knock, and I could let you out, you know.” He was looking up into the sky all the time he was speaking, and this Alice thought decidedly uncivil. “But perhaps he can’t help it,” she said to herself; “his eyes are so <i>very</i> nearly at the top of his head. But at any rate he might answer questions.—How am I to get in?” she repeated, aloud.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000469": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000469",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000470": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000470",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I shall sit here,” the Footman remarked, “till tomorrow—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000471": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000471",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000472": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000472",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>At this moment the door of the house opened, and a large plate came skimming out, straight at the Footman’s head: it just grazed his nose, and broke to pieces against one of the trees behind him.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000473": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000473",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000474": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000474",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“—or next day, maybe,” the Footman continued in the same tone, exactly as if nothing had happened.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000475": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000475",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000476": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000476",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“How am I to get in?” asked Alice again, in a louder tone.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000477": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000477",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000478": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000478",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“<i>Are</i> you to get in at all?” said the Footman. “That’s the first question, you know.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000479": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000479",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000480": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000480",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>It was, no doubt: only Alice did not like to be told so. “It’s really dreadful,” she muttered to herself, “the way all the creatures argue. It’s enough to drive one crazy!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000481": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000481",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000482": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000482",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Footman seemed to think this a good opportunity for repeating his remark, with variations. “I shall sit here,” he said, “on and off, for days and days.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000483": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000483",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000484": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000484",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“But what am <i>I</i> to do?” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000485": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000485",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000486": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000486",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Anything you like,” said the Footman, and began whistling.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000487": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000487",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000488": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000488",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Oh, there’s no use in talking to him,” said Alice desperately: “he’s perfectly idiotic!” And she opened the door and went in.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000489": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000489",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000490": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000490",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The door led right into a large kitchen, which was full of smoke from one end to the other: the Duchess was sitting on a three-legged stool in the middle, nursing a baby; the cook was leaning over the fire, stirring a large cauldron which seemed to be full of soup.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000491": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000491",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000492": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000492",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“There’s certainly too much pepper in that soup!” Alice said to herself, as well as she could for sneezing.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000493": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000493",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000494": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000494",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>There was certainly too much of it in the air. Even the Duchess sneezed occasionally; and as for the baby, it was sneezing and howling alternately without a moment’s pause. The only things in the kitchen that did not sneeze, were the cook, and a large cat which was sitting on the hearth and grinning from ear to ear.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000495": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000495",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000496": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000496",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Please would you tell me,” said Alice, a little timidly, for she was not quite sure whether it was good manners for her to speak first, “why your cat grins like that?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000497": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000497",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000498": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000498",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It’s a Cheshire cat,” said the Duchess, “and that’s why. Pig!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000499": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000499",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000500": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000500",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>She said the last word with such sudden violence that Alice quite jumped; but she saw in another moment that it was addressed to the baby, and not to her, so she took courage, and went on again:—</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000501": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000501",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000502": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000502",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I didn’t know that Cheshire cats always grinned; in fact, I didn’t know that cats <i>could</i> grin.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000503": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000503",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000504": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000504",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“They all can,” said the Duchess; “and most of ’em do.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000505": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000505",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000506": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000506",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I don’t know of any that do,” Alice said very politely, feeling quite pleased to have got into a conversation.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000507": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000507",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000508": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000508",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You don’t know much,” said the Duchess; “and that’s a fact.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000509": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000509",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000510": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000510",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice did not at all like the tone of this remark, and thought it would be as well to introduce some other subject of conversation. While she was trying to fix on one, the cook took the cauldron of soup off the fire, and at once set to work throwing everything within her reach at the Duchess and the baby—the fire-irons came first; then followed a shower of saucepans, plates, and dishes. The Duchess took no notice of them even when they hit her; and the baby was howling so much already, that it was quite impossible to say whether the blows hurt it or not.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000511": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000511",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000512": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000512",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Oh, <i>please</i> mind what you’re doing!” cried Alice, jumping up and down in an agony of terror. “Oh, there goes his <i>precious</i> nose!” as an unusually large saucepan flew close by it, and very nearly carried it off.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000513": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000513",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000514": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000514",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“If everybody minded their own business,” the Duchess said in a hoarse growl, “the world would go round a deal faster than it does.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000515": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000515",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000516": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000516",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Which would <i>not</i> be an advantage,” said Alice, who felt very glad to get an opportunity of showing off a little of her knowledge. “Just think of what work it would make with the day and night! You see the earth takes twenty-four hours to turn round on its axis—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000517": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000517",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000518": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000518",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Talking of axes,” said the Duchess, “chop off her head!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000519": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000519",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000520": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000520",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice glanced rather anxiously at the cook, to see if she meant to take the hint; but the cook was busily stirring the soup, and seemed not to be listening, so she went on again: “Twenty-four hours, I <i>think</i>; or is it twelve? I—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000521": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000521",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000522": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000522",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Oh, don’t bother <i>me</i>,” said the Duchess; “I never could abide figures!” And with that she began nursing her child again, singing a sort of lullaby to it as she did so, and giving it a violent shake at the end of every line:</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000523": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000523",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000524": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000524",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"poem\">“Speak roughly to your little boy,<br>\n    And beat him when he sneezes:<br>\nHe only does it to annoy,<br>\n    Because he knows it teases.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000525": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000525",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000526": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000526",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"center\">CHORUS.<br>\n(In which the cook and the baby joined):</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000527": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000527",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000528": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000528",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"poem\">“Wow! wow! wow!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000529": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000529",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000530": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000530",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>While the Duchess sang the second verse of the song, she kept tossing the baby violently up and down, and the poor little thing howled so, that Alice could hardly hear the words:—</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000531": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000531",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000532": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000532",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"poem\">“I speak severely to my boy,<br>\n    I beat him when he sneezes;<br>\nFor he can thoroughly enjoy<br>\n    The pepper when he pleases!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000533": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000533",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000534": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000534",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"center\">CHORUS.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000535": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000535",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000536": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000536",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"poem\">“Wow! wow! wow!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000537": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000537",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000538": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000538",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Here! you may nurse it a bit, if you like!” the Duchess said to Alice, flinging the baby at her as she spoke. “I must go and get ready to play croquet with the Queen,” and she hurried out of the room. The cook threw a frying-pan after her as she went out, but it just missed her.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000539": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000539",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000540": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000540",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice caught the baby with some difficulty, as it was a queer-shaped little creature, and held out its arms and legs in all directions, “just like a star-fish,” thought Alice. The poor little thing was snorting like a steam-engine when she caught it, and kept doubling itself up and straightening itself out again, so that altogether, for the first minute or two, it was as much as she could do to hold it.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000541": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000541",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000542": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000542",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>As soon as she had made out the proper way of nursing it, (which was to twist it up into a sort of knot, and then keep tight hold of its right ear and left foot, so as to prevent its undoing itself,) she carried it out into the open air. “If I don’t take this child away with me,” thought Alice, “they’re sure to kill it in a day or two: wouldn’t it be murder to leave it behind?” She said the last words out loud, and the little thing grunted in reply (it had left off sneezing by this time). “Don’t grunt,” said Alice; “that’s not at all a proper way of expressing yourself.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000543": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000543",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000544": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000544",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The baby grunted again, and Alice looked very anxiously into its face to see what was the matter with it. There could be no doubt that it had a <i>very</i> turn-up nose, much more like a snout than a real nose; also its eyes were getting extremely small for a baby: altogether Alice did not like the look of the thing at all. “But perhaps it was only sobbing,” she thought, and looked into its eyes again, to see if there were any tears.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000545": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000545",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000546": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000546",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>No, there were no tears. “If you’re going to turn into a pig, my dear,” said Alice, seriously, “I’ll have nothing more to do with you. Mind now!” The poor little thing sobbed again (or grunted, it was impossible to say which), and they went on for some while in silence.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000547": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000547",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000548": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000548",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice was just beginning to think to herself, “Now, what am I to do with this creature when I get it home?” when it grunted again, so violently, that she looked down into its face in some alarm. This time there could be <i>no</i> mistake about it: it was neither more nor less than a pig, and she felt that it would be quite absurd for her to carry it further.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000549": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000549",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000550": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000550",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>So she set the little creature down, and felt quite relieved to see it trot away quietly into the wood. “If it had grown up,” she said to herself, “it would have made a dreadfully ugly child: but it makes rather a handsome pig, I think.” And she began thinking over other children she knew, who might do very well as pigs, and was just saying to herself, “if one only knew the right way to change them—” when she was a little startled by seeing the Cheshire Cat sitting on a bough of a tree a few yards off.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000551": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000551",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000552": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000552",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Cat only grinned when it saw Alice. It looked good-natured, she thought: still it had <i>very</i> long claws and a great many teeth, so she felt that it ought to be treated with respect.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000553": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000553",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000554": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000554",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Cheshire Puss,” she began, rather timidly, as she did not at all know whether it would like the name: however, it only grinned a little wider. “Come, it’s pleased so far,” thought Alice, and she went on. “Would you tell me, please, which way I ought to go from here?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000555": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000555",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000556": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000556",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“That depends a good deal on where you want to get to,” said the Cat.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000557": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000557",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000558": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000558",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I don’t much care where—” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000559": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000559",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000560": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000560",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Then it doesn’t matter which way you go,” said the Cat.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000561": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000561",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000562": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000562",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“—so long as I get <i>somewhere</i>,” Alice added as an explanation.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000563": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000563",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000564": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000564",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Oh, you’re sure to do that,” said the Cat, “if you only walk long enough.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000565": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000565",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000566": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000566",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice felt that this could not be denied, so she tried another question. “What sort of people live about here?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000567": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000567",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000568": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000568",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“In <i>that</i> direction,” the Cat said, waving its right paw round, “lives a Hatter: and in <i>that</i> direction,” waving the other paw, “lives a March Hare. Visit either you like: they’re both mad.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000569": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000569",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000570": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000570",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“But I don’t want to go among mad people,” Alice remarked.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000571": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000571",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000572": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000572",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Oh, you can’t help that,” said the Cat: “we’re all mad here. I’m mad. You’re mad.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000573": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000573",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000574": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000574",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“How do you know I’m mad?” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000575": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000575",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000576": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000576",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You must be,” said the Cat, “or you wouldn’t have come here.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000577": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000577",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000578": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000578",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice didn’t think that proved it at all; however, she went on “And how do you know that you’re mad?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000579": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000579",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000580": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000580",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“To begin with,” said the Cat, “a dog’s not mad. You grant that?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000581": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000581",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000582": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000582",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I suppose so,” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000583": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000583",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000584": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000584",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, then,” the Cat went on, “you see, a dog growls when it’s angry, and wags its tail when it’s pleased. Now <i>I</i> growl when I’m pleased, and wag my tail when I’m angry. Therefore I’m mad.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000585": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000585",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000586": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000586",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“<i>I</i> call it purring, not growling,” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000587": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000587",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000588": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000588",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Call it what you like,” said the Cat. “Do you play croquet with the Queen to-day?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000589": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000589",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000590": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000590",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I should like it very much,” said Alice, “but I haven’t been invited yet.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000591": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000591",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000592": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000592",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You’ll see me there,” said the Cat, and vanished.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000593": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000593",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000594": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000594",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice was not much surprised at this, she was getting so used to queer things happening. While she was looking at the place where it had been, it suddenly appeared again.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000595": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000595",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000596": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000596",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“By-the-bye, what became of the baby?” said the Cat. “I’d nearly forgotten to ask.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000597": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000597",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000598": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000598",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It turned into a pig,” Alice quietly said, just as if it had come back in a natural way.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000599": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000599",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000600": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000600",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I thought it would,” said the Cat, and vanished again.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000601": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000601",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000602": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000602",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice waited a little, half expecting to see it again, but it did not appear, and after a minute or two she walked on in the direction in which the March Hare was said to live. “I’ve seen hatters before,” she said to herself; “the March Hare will be much the most interesting, and perhaps as this is May it won’t be raving mad—at least not so mad as it was in March.” As she said this, she looked up, and there was the Cat again, sitting on a branch of a tree.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000603": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000603",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000604": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000604",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Did you say pig, or fig?” said the Cat.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000605": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000605",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000606": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000606",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I said pig,” replied Alice; “and I wish you wouldn’t keep appearing and vanishing so suddenly: you make one quite giddy.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000607": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000607",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000608": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000608",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“All right,” said the Cat; and this time it vanished quite slowly, beginning with the end of the tail, and ending with the grin, which remained some time after the rest of it had gone.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000609": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000609",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000610": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000610",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well! I’ve often seen a cat without a grin,” thought Alice; “but a grin without a cat! It’s the most curious thing I ever saw in my life!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000611": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000611",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000612": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000612",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>She had not gone much farther before she came in sight of the house of the March Hare: she thought it must be the right house, because the chimneys were shaped like ears and the roof was thatched with fur. It was so large a house, that she did not like to go nearer till she had nibbled some more of the lefthand bit of mushroom, and raised herself to about two feet high: even then she walked up towards it rather timidly, saying to herself “Suppose it should be raving mad after all! I almost wish I’d gone to see the Hatter instead!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000613": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000613",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000614": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000614",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000615": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000615",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><h2><a></a>CHAPTER VII.<br>\nA Mad Tea-Party</h2></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000616": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000616",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000617": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000617",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>There was a table set out under a tree in front of the house, and the March Hare and the Hatter were having tea at it: a Dormouse was sitting between them, fast asleep, and the other two were using it as a cushion, resting their elbows on it, and talking over its head. “Very uncomfortable for the Dormouse,” thought Alice; “only, as it’s asleep, I suppose it doesn’t mind.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000618": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000618",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000619": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000619",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The table was a large one, but the three were all crowded together at one corner of it: “No room! No room!” they cried out when they saw Alice coming. “There’s <i>plenty</i> of room!” said Alice indignantly, and she sat down in a large arm-chair at one end of the table.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000620": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000620",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000621": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000621",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Have some wine,” the March Hare said in an encouraging tone.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000622": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000622",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000623": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000623",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice looked all round the table, but there was nothing on it but tea. “I don’t see any wine,” she remarked.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000624": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000624",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000625": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000625",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“There isn’t any,” said the March Hare.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000626": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000626",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000627": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000627",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Then it wasn’t very civil of you to offer it,” said Alice angrily.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000628": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000628",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000629": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000629",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It wasn’t very civil of you to sit down without being invited,” said the March Hare.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000630": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000630",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000631": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000631",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I didn’t know it was <i>your</i> table,” said Alice; “it’s laid for a great many more than three.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000632": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000632",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000633": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000633",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Your hair wants cutting,” said the Hatter. He had been looking at Alice for some time with great curiosity, and this was his first speech.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000634": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000634",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000635": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000635",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You should learn not to make personal remarks,” Alice said with some severity; “it’s very rude.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000636": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000636",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000637": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000637",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Hatter opened his eyes very wide on hearing this; but all he <i>said</i> was, “Why is a raven like a writing-desk?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000638": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000638",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000639": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000639",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Come, we shall have some fun now!” thought Alice. “I’m glad they’ve begun asking riddles.—I believe I can guess that,” she added aloud.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000640": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000640",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000641": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000641",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Do you mean that you think you can find out the answer to it?” said the March Hare.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000642": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000642",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000643": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000643",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Exactly so,” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000644": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000644",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000645": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000645",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Then you should say what you mean,” the March Hare went on.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000646": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000646",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000647": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000647",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I do,” Alice hastily replied; “at least—at least I mean what I say—that’s the same thing, you know.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000648": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000648",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000649": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000649",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Not the same thing a bit!” said the Hatter. “You might just as well say that ‘I see what I eat’ is the same thing as ‘I eat what I see’!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000650": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000650",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000651": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000651",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You might just as well say,” added the March Hare, “that ‘I like what I get’ is the same thing as ‘I get what I like’!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000652": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000652",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000653": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000653",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You might just as well say,” added the Dormouse, who seemed to be talking in his sleep, “that ‘I breathe when I sleep’ is the same thing as ‘I sleep when I breathe’!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000654": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000654",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000655": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000655",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It <i>is</i> the same thing with you,” said the Hatter, and here the conversation dropped, and the party sat silent for a minute, while Alice thought over all she could remember about ravens and writing-desks, which wasn’t much.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000656": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000656",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000657": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000657",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Hatter was the first to break the silence. “What day of the month is it?” he said, turning to Alice: he had taken his watch out of his pocket, and was looking at it uneasily, shaking it every now and then, and holding it to his ear.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000658": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000658",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000659": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000659",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice considered a little, and then said “The fourth.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000660": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000660",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000661": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000661",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Two days wrong!” sighed the Hatter. “I told you butter wouldn’t suit the works!” he added looking angrily at the March Hare.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000662": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000662",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000663": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000663",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It was the <i>best</i> butter,” the March Hare meekly replied.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000664": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000664",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000665": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000665",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Yes, but some crumbs must have got in as well,” the Hatter grumbled: “you shouldn’t have put it in with the bread-knife.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000666": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000666",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000667": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000667",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The March Hare took the watch and looked at it gloomily: then he dipped it into his cup of tea, and looked at it again: but he could think of nothing better to say than his first remark, “It was the <i>best</i> butter, you know.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000668": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000668",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000669": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000669",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice had been looking over his shoulder with some curiosity. “What a funny watch!” she remarked. “It tells the day of the month, and doesn’t tell what o’clock it is!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000670": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000670",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000671": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000671",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Why should it?” muttered the Hatter. “Does <i>your</i> watch tell you what year it is?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000672": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000672",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000673": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000673",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Of course not,” Alice replied very readily: “but that’s because it stays the same year for such a long time together.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000674": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000674",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000675": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000675",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Which is just the case with <i>mine</i>,” said the Hatter.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000676": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000676",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000677": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000677",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice felt dreadfully puzzled. The Hatter’s remark seemed to have no sort of meaning in it, and yet it was certainly English. “I don’t quite understand you,” she said, as politely as she could.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000678": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000678",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000679": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000679",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“The Dormouse is asleep again,” said the Hatter, and he poured a little hot tea upon its nose.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000680": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000680",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000681": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000681",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Dormouse shook its head impatiently, and said, without opening its eyes, “Of course, of course; just what I was going to remark myself.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000682": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000682",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000683": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000683",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Have you guessed the riddle yet?” the Hatter said, turning to Alice again.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000684": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000684",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000685": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000685",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“No, I give it up,” Alice replied: “what’s the answer?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000686": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000686",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000687": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000687",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I haven’t the slightest idea,” said the Hatter.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000688": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000688",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000689": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000689",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Nor I,” said the March Hare.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000690": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000690",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000691": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000691",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice sighed wearily. “I think you might do something better with the time,” she said, “than waste it in asking riddles that have no answers.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000692": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000692",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000693": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000693",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“If you knew Time as well as I do,” said the Hatter, “you wouldn’t talk about wasting <i>it</i>. It’s <i>him</i>.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000694": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000694",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000695": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000695",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I don’t know what you mean,” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000696": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000696",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000697": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000697",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Of course you don’t!” the Hatter said, tossing his head contemptuously. “I dare say you never even spoke to Time!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000698": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000698",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000699": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000699",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Perhaps not,” Alice cautiously replied: “but I know I have to beat time when I learn music.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000700": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000700",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000701": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000701",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Ah! that accounts for it,” said the Hatter. “He won’t stand beating. Now, if you only kept on good terms with him, he’d do almost anything you liked with the clock. For instance, suppose it were nine o’clock in the morning, just time to begin lessons: you’d only have to whisper a hint to Time, and round goes the clock in a twinkling! Half-past one, time for dinner!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000702": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000702",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000703": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000703",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>(“I only wish it was,” the March Hare said to itself in a whisper.)</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000704": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000704",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000705": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000705",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“That would be grand, certainly,” said Alice thoughtfully: “but then—I shouldn’t be hungry for it, you know.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000706": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000706",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000707": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000707",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Not at first, perhaps,” said the Hatter: “but you could keep it to half-past one as long as you liked.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000708": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000708",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000709": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000709",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Is that the way <i>you</i> manage?” Alice asked.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000710": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000710",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000711": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000711",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Hatter shook his head mournfully. “Not I!” he replied. “We quarrelled last March—just before <i>he</i> went mad, you know—” (pointing with his tea spoon at the March Hare,) “—it was at the great concert given by the Queen of Hearts, and I had to sing</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000712": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000712",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000713": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000713",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"poem\">‘Twinkle, twinkle, little bat!<br>\nHow I wonder what you’re at!’</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000714": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000714",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000715": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000715",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"noindent\">You know the song, perhaps?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000716": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000716",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000717": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000717",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’ve heard something like it,” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000718": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000718",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000719": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000719",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It goes on, you know,” the Hatter continued, “in this way:—</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000720": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000720",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000721": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000721",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"poem\">‘Up above the world you fly,<br>\nLike a tea-tray in the sky.<br>\n                    Twinkle, twinkle—’”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000722": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000722",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000723": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000723",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Here the Dormouse shook itself, and began singing in its sleep “<i>Twinkle, twinkle, twinkle, twinkle</i>—” and went on so long that they had to pinch it to make it stop.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000724": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000724",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000725": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000725",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, I’d hardly finished the first verse,” said the Hatter, “when the Queen jumped up and bawled out, ‘He’s murdering the time! Off with his head!’”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000726": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000726",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000727": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000727",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“How dreadfully savage!” exclaimed Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000728": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000728",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000729": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000729",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“And ever since that,” the Hatter went on in a mournful tone, “he won’t do a thing I ask! It’s always six o’clock now.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000730": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000730",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000731": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000731",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>A bright idea came into Alice’s head. “Is that the reason so many tea-things are put out here?” she asked.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000732": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000732",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000733": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000733",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Yes, that’s it,” said the Hatter with a sigh: “it’s always tea-time, and we’ve no time to wash the things between whiles.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000734": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000734",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000735": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000735",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Then you keep moving round, I suppose?” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000736": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000736",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000737": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000737",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Exactly so,” said the Hatter: “as the things get used up.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000738": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000738",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000739": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000739",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“But what happens when you come to the beginning again?” Alice ventured to ask.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000740": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000740",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000741": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000741",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Suppose we change the subject,” the March Hare interrupted, yawning. “I’m getting tired of this. I vote the young lady tells us a story.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000742": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000742",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000743": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000743",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’m afraid I don’t know one,” said Alice, rather alarmed at the proposal.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000744": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000744",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000745": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000745",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Then the Dormouse shall!” they both cried. “Wake up, Dormouse!” And they pinched it on both sides at once.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000746": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000746",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000747": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000747",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Dormouse slowly opened his eyes. “I wasn’t asleep,” he said in a hoarse, feeble voice: “I heard every word you fellows were saying.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000748": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000748",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000749": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000749",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Tell us a story!” said the March Hare.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000750": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000750",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000751": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000751",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Yes, please do!” pleaded Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000752": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000752",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000753": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000753",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“And be quick about it,” added the Hatter, “or you’ll be asleep again before it’s done.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000754": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000754",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000755": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000755",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Once upon a time there were three little sisters,” the Dormouse began in a great hurry; “and their names were Elsie, Lacie, and Tillie; and they lived at the bottom of a well—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000756": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000756",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000757": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000757",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What did they live on?” said Alice, who always took a great interest in questions of eating and drinking.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000758": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000758",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000759": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000759",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“They lived on treacle,” said the Dormouse, after thinking a minute or two.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000760": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000760",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000761": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000761",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“They couldn’t have done that, you know,” Alice gently remarked; “they’d have been ill.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000762": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000762",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000763": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000763",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“So they were,” said the Dormouse; “<i>very</i> ill.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000764": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000764",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000765": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000765",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice tried to fancy to herself what such an extraordinary ways of living would be like, but it puzzled her too much, so she went on: “But why did they live at the bottom of a well?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000766": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000766",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000767": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000767",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Take some more tea,” the March Hare said to Alice, very earnestly.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000768": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000768",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000769": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000769",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’ve had nothing yet,” Alice replied in an offended tone, “so I can’t take more.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000770": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000770",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000771": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000771",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You mean you can’t take <i>less</i>,” said the Hatter: “it’s very easy to take <i>more</i> than nothing.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000772": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000772",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000773": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000773",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Nobody asked <i>your</i> opinion,” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000774": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000774",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000775": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000775",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Who’s making personal remarks now?” the Hatter asked triumphantly.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000776": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000776",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000777": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000777",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice did not quite know what to say to this: so she helped herself to some tea and bread-and-butter, and then turned to the Dormouse, and repeated her question. “Why did they live at the bottom of a well?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000778": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000778",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000779": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000779",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Dormouse again took a minute or two to think about it, and then said, “It was a treacle-well.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000780": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000780",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000781": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000781",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“There’s no such thing!” Alice was beginning very angrily, but the Hatter and the March Hare went “Sh! sh!” and the Dormouse sulkily remarked, “If you can’t be civil, you’d better finish the story for yourself.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000782": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000782",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000783": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000783",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“No, please go on!” Alice said very humbly; “I won’t interrupt again. I dare say there may be <i>one</i>.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000784": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000784",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000785": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000785",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“One, indeed!” said the Dormouse indignantly. However, he consented to go on. “And so these three little sisters—they were learning to draw, you know—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000786": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000786",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000787": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000787",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What did they draw?” said Alice, quite forgetting her promise.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000788": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000788",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000789": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000789",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Treacle,” said the Dormouse, without considering at all this time.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000790": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000790",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000791": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000791",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I want a clean cup,” interrupted the Hatter: “let’s all move one place on.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000792": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000792",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000793": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000793",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>He moved on as he spoke, and the Dormouse followed him: the March Hare moved into the Dormouse’s place, and Alice rather unwillingly took the place of the March Hare. The Hatter was the only one who got any advantage from the change: and Alice was a good deal worse off than before, as the March Hare had just upset the milk-jug into his plate.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000794": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000794",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000795": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000795",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice did not wish to offend the Dormouse again, so she began very cautiously: “But I don’t understand. Where did they draw the treacle from?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000796": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000796",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000797": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000797",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You can draw water out of a water-well,” said the Hatter; “so I should think you could draw treacle out of a treacle-well—eh, stupid?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000798": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000798",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000799": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000799",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“But they were <i>in</i> the well,” Alice said to the Dormouse, not choosing to notice this last remark.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000800": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000800",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000801": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000801",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Of course they were,” said the Dormouse; “—well in.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000802": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000802",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000803": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000803",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>This answer so confused poor Alice, that she let the Dormouse go on for some time without interrupting it.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000804": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000804",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000805": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000805",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“They were learning to draw,” the Dormouse went on, yawning and rubbing its eyes, for it was getting very sleepy; “and they drew all manner of things—everything that begins with an M—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000806": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000806",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000807": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000807",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Why with an M?” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000808": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000808",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000809": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000809",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Why not?” said the March Hare.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000810": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000810",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000811": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000811",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice was silent.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000812": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000812",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000813": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000813",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Dormouse had closed its eyes by this time, and was going off into a doze; but, on being pinched by the Hatter, it woke up again with a little shriek, and went on: “—that begins with an M, such as mouse-traps, and the moon, and memory, and muchness—you know you say things are “much of a muchness”—did you ever see such a thing as a drawing of a muchness?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000814": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000814",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000815": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000815",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Really, now you ask me,” said Alice, very much confused, “I don’t think—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000816": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000816",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000817": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000817",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Then you shouldn’t talk,” said the Hatter.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000818": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000818",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000819": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000819",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>This piece of rudeness was more than Alice could bear: she got up in great disgust, and walked off; the Dormouse fell asleep instantly, and neither of the others took the least notice of her going, though she looked back once or twice, half hoping that they would call after her: the last time she saw them, they were trying to put the Dormouse into the teapot.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000820": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000820",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000821": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000821",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“At any rate I’ll never go <i>there</i> again!” said Alice as she picked her way through the wood. “It’s the stupidest tea-party I ever was at in all my life!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000822": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000822",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000823": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000823",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Just as she said this, she noticed that one of the trees had a door leading right into it. “That’s very curious!” she thought. “But everything’s curious today. I think I may as well go in at once.” And in she went.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000824": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000824",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000825": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000825",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Once more she found herself in the long hall, and close to the little glass table. “Now, I’ll manage better this time,” she said to herself, and began by taking the little golden key, and unlocking the door that led into the garden. Then she went to work nibbling at the mushroom (she had kept a piece of it in her pocket) till she was about a foot high: then she walked down the little passage: and <i>then</i>—she found herself at last in the beautiful garden, among the bright flower-beds and the cool fountains.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000826": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000826",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000827": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000827",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000828": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000828",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><h2><a></a>CHAPTER VIII.<br>\nThe Queen’s Croquet-Ground</h2></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000829": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000829",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000830": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000830",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>A large rose-tree stood near the entrance of the garden: the roses growing on it were white, but there were three gardeners at it, busily painting them red. Alice thought this a very curious thing, and she went nearer to watch them, and just as she came up to them she heard one of them say, “Look out now, Five! Don’t go splashing paint over me like that!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000831": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000831",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000832": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000832",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I couldn’t help it,” said Five, in a sulky tone; “Seven jogged my elbow.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000833": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000833",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000834": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000834",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>On which Seven looked up and said, “That’s right, Five! Always lay the blame on others!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000835": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000835",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000836": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000836",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“<i>You’d</i> better not talk!” said Five. “I heard the Queen say only yesterday you deserved to be beheaded!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000837": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000837",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000838": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000838",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What for?” said the one who had spoken first.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000839": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000839",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000840": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000840",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“That’s none of <i>your</i> business, Two!” said Seven.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000841": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000841",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000842": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000842",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Yes, it <i>is</i> his business!” said Five, “and I’ll tell him—it was for bringing the cook tulip-roots instead of onions.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000843": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000843",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000844": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000844",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Seven flung down his brush, and had just begun “Well, of all the unjust things—” when his eye chanced to fall upon Alice, as she stood watching them, and he checked himself suddenly: the others looked round also, and all of them bowed low.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000845": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000845",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000846": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000846",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Would you tell me,” said Alice, a little timidly, “why you are painting those roses?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000847": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000847",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000848": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000848",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Five and Seven said nothing, but looked at Two. Two began in a low voice, “Why the fact is, you see, Miss, this here ought to have been a <i>red</i> rose-tree, and we put a white one in by mistake; and if the Queen was to find it out, we should all have our heads cut off, you know. So you see, Miss, we’re doing our best, afore she comes, to—” At this moment Five, who had been anxiously looking across the garden, called out “The Queen! The Queen!” and the three gardeners instantly threw themselves flat upon their faces. There was a sound of many footsteps, and Alice looked round, eager to see the Queen.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000849": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000849",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000850": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000850",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>First came ten soldiers carrying clubs; these were all shaped like the three gardeners, oblong and flat, with their hands and feet at the corners: next the ten courtiers; these were ornamented all over with diamonds, and walked two and two, as the soldiers did. After these came the royal children; there were ten of them, and the little dears came jumping merrily along hand in hand, in couples: they were all ornamented with hearts. Next came the guests, mostly Kings and Queens, and among them Alice recognised the White Rabbit: it was talking in a hurried nervous manner, smiling at everything that was said, and went by without noticing her. Then followed the Knave of Hearts, carrying the King’s crown on a crimson velvet cushion; and, last of all this grand procession, came THE KING AND QUEEN OF HEARTS.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000851": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000851",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000852": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000852",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice was rather doubtful whether she ought not to lie down on her face like the three gardeners, but she could not remember ever having heard of such a rule at processions; “and besides, what would be the use of a procession,” thought she, “if people had all to lie down upon their faces, so that they couldn’t see it?” So she stood still where she was, and waited.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000853": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000853",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000854": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000854",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>When the procession came opposite to Alice, they all stopped and looked at her, and the Queen said severely “Who is this?” She said it to the Knave of Hearts, who only bowed and smiled in reply.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000855": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000855",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000856": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000856",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Idiot!” said the Queen, tossing her head impatiently; and, turning to Alice, she went on, “What’s your name, child?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000857": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000857",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000858": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000858",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“My name is Alice, so please your Majesty,” said Alice very politely; but she added, to herself, “Why, they’re only a pack of cards, after all. I needn’t be afraid of them!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000859": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000859",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000860": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000860",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“And who are <i>these?</i>” said the Queen, pointing to the three gardeners who were lying round the rose-tree; for, you see, as they were lying on their faces, and the pattern on their backs was the same as the rest of the pack, she could not tell whether they were gardeners, or soldiers, or courtiers, or three of her own children.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000861": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000861",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000862": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000862",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“How should <i>I</i> know?” said Alice, surprised at her own courage. “It’s no business of <i>mine</i>.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000863": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000863",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000864": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000864",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Queen turned crimson with fury, and, after glaring at her for a moment like a wild beast, screamed “Off with her head! Off—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000865": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000865",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000866": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000866",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Nonsense!” said Alice, very loudly and decidedly, and the Queen was silent.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000867": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000867",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000868": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000868",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The King laid his hand upon her arm, and timidly said “Consider, my dear: she is only a child!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000869": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000869",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000870": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000870",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Queen turned angrily away from him, and said to the Knave “Turn them over!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000871": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000871",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000872": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000872",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Knave did so, very carefully, with one foot.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000873": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000873",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000874": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000874",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Get up!” said the Queen, in a shrill, loud voice, and the three gardeners instantly jumped up, and began bowing to the King, the Queen, the royal children, and everybody else.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000875": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000875",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000876": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000876",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Leave off that!” screamed the Queen. “You make me giddy.” And then, turning to the rose-tree, she went on, “What <i>have</i> you been doing here?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000877": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000877",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000878": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000878",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“May it please your Majesty,” said Two, in a very humble tone, going down on one knee as he spoke, “we were trying—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000879": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000879",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000880": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000880",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“<i>I</i> see!” said the Queen, who had meanwhile been examining the roses. “Off with their heads!” and the procession moved on, three of the soldiers remaining behind to execute the unfortunate gardeners, who ran to Alice for protection.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000881": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000881",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000882": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000882",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You shan’t be beheaded!” said Alice, and she put them into a large flower-pot that stood near. The three soldiers wandered about for a minute or two, looking for them, and then quietly marched off after the others.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000883": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000883",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000884": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000884",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Are their heads off?” shouted the Queen.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000885": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000885",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000886": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000886",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Their heads are gone, if it please your Majesty!” the soldiers shouted in reply.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000887": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000887",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000888": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000888",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“That’s right!” shouted the Queen. “Can you play croquet?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000889": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000889",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000890": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000890",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The soldiers were silent, and looked at Alice, as the question was evidently meant for her.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000891": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000891",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000892": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000892",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Yes!” shouted Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000893": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000893",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000894": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000894",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Come on, then!” roared the Queen, and Alice joined the procession, wondering very much what would happen next.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000895": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000895",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000896": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000896",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It’s—it’s a very fine day!” said a timid voice at her side. She was walking by the White Rabbit, who was peeping anxiously into her face.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000897": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000897",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000898": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000898",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Very,” said Alice: “—where’s the Duchess?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000899": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000899",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000900": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000900",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Hush! Hush!” said the Rabbit in a low, hurried tone. He looked anxiously over his shoulder as he spoke, and then raised himself upon tiptoe, put his mouth close to her ear, and whispered “She’s under sentence of execution.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000901": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000901",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000902": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000902",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What for?” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000903": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000903",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000904": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000904",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Did you say ‘What a pity!’?” the Rabbit asked.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000905": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000905",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000906": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000906",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“No, I didn’t,” said Alice: “I don’t think it’s at all a pity. I said ‘What for?’”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000907": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000907",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000908": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000908",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“She boxed the Queen’s ears—” the Rabbit began. Alice gave a little scream of laughter. “Oh, hush!” the Rabbit whispered in a frightened tone. “The Queen will hear you! You see, she came rather late, and the Queen said—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000909": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000909",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000910": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000910",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Get to your places!” shouted the Queen in a voice of thunder, and people began running about in all directions, tumbling up against each other; however, they got settled down in a minute or two, and the game began. Alice thought she had never seen such a curious croquet-ground in her life; it was all ridges and furrows; the balls were live hedgehogs, the mallets live flamingoes, and the soldiers had to double themselves up and to stand on their hands and feet, to make the arches.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000911": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000911",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000912": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000912",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The chief difficulty Alice found at first was in managing her flamingo: she succeeded in getting its body tucked away, comfortably enough, under her arm, with its legs hanging down, but generally, just as she had got its neck nicely straightened out, and was going to give the hedgehog a blow with its head, it <i>would</i> twist itself round and look up in her face, with such a puzzled expression that she could not help bursting out laughing: and when she had got its head down, and was going to begin again, it was very provoking to find that the hedgehog had unrolled itself, and was in the act of crawling away: besides all this, there was generally a ridge or furrow in the way wherever she wanted to send the hedgehog to, and, as the doubled-up soldiers were always getting up and walking off to other parts of the ground, Alice soon came to the conclusion that it was a very difficult game indeed.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000913": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000913",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000914": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000914",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The players all played at once without waiting for turns, quarrelling all the while, and fighting for the hedgehogs; and in a very short time the Queen was in a furious passion, and went stamping about, and shouting “Off with his head!” or “Off with her head!” about once in a minute.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000915": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000915",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000916": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000916",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice began to feel very uneasy: to be sure, she had not as yet had any dispute with the Queen, but she knew that it might happen any minute, “and then,” thought she, “what would become of me? They’re dreadfully fond of beheading people here; the great wonder is, that there’s any one left alive!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000917": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000917",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000918": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000918",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>She was looking about for some way of escape, and wondering whether she could get away without being seen, when she noticed a curious appearance in the air: it puzzled her very much at first, but, after watching it a minute or two, she made it out to be a grin, and she said to herself “It’s the Cheshire Cat: now I shall have somebody to talk to.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000919": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000919",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000920": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000920",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“How are you getting on?” said the Cat, as soon as there was mouth enough for it to speak with.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000921": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000921",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000922": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000922",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice waited till the eyes appeared, and then nodded. “It’s no use speaking to it,” she thought, “till its ears have come, or at least one of them.” In another minute the whole head appeared, and then Alice put down her flamingo, and began an account of the game, feeling very glad she had someone to listen to her. The Cat seemed to think that there was enough of it now in sight, and no more of it appeared.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000923": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000923",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000924": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000924",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I don’t think they play at all fairly,” Alice began, in rather a complaining tone, “and they all quarrel so dreadfully one can’t hear oneself speak—and they don’t seem to have any rules in particular; at least, if there are, nobody attends to them—and you’ve no idea how confusing it is all the things being alive; for instance, there’s the arch I’ve got to go through next walking about at the other end of the ground—and I should have croqueted the Queen’s hedgehog just now, only it ran away when it saw mine coming!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000925": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000925",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000926": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000926",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“How do you like the Queen?” said the Cat in a low voice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000927": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000927",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000928": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000928",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Not at all,” said Alice: “she’s so extremely—” Just then she noticed that the Queen was close behind her, listening: so she went on, “—likely to win, that it’s hardly worth while finishing the game.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000929": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000929",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000930": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000930",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Queen smiled and passed on.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000931": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000931",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000932": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000932",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Who <i>are</i> you talking to?” said the King, going up to Alice, and looking at the Cat’s head with great curiosity.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000933": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000933",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000934": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000934",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It’s a friend of mine—a Cheshire Cat,” said Alice: “allow me to introduce it.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000935": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000935",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000936": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000936",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I don’t like the look of it at all,” said the King: “however, it may kiss my hand if it likes.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000937": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000937",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000938": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000938",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’d rather not,” the Cat remarked.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000939": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000939",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000940": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000940",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Don’t be impertinent,” said the King, “and don’t look at me like that!” He got behind Alice as he spoke.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000941": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000941",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000942": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000942",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“A cat may look at a king,” said Alice. “I’ve read that in some book, but I don’t remember where.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000943": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000943",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000944": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000944",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, it must be removed,” said the King very decidedly, and he called the Queen, who was passing at the moment, “My dear! I wish you would have this cat removed!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000945": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000945",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000946": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000946",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Queen had only one way of settling all difficulties, great or small. “Off with his head!” she said, without even looking round.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000947": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000947",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000948": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000948",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’ll fetch the executioner myself,” said the King eagerly, and he hurried off.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000949": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000949",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000950": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000950",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice thought she might as well go back, and see how the game was going on, as she heard the Queen’s voice in the distance, screaming with passion. She had already heard her sentence three of the players to be executed for having missed their turns, and she did not like the look of things at all, as the game was in such confusion that she never knew whether it was her turn or not. So she went in search of her hedgehog.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000951": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000951",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000952": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000952",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The hedgehog was engaged in a fight with another hedgehog, which seemed to Alice an excellent opportunity for croqueting one of them with the other: the only difficulty was, that her flamingo was gone across to the other side of the garden, where Alice could see it trying in a helpless sort of way to fly up into a tree.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000953": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000953",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000954": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000954",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>By the time she had caught the flamingo and brought it back, the fight was over, and both the hedgehogs were out of sight: “but it doesn’t matter much,” thought Alice, “as all the arches are gone from this side of the ground.” So she tucked it away under her arm, that it might not escape again, and went back for a little more conversation with her friend.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000955": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000955",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000956": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000956",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>When she got back to the Cheshire Cat, she was surprised to find quite a large crowd collected round it: there was a dispute going on between the executioner, the King, and the Queen, who were all talking at once, while all the rest were quite silent, and looked very uncomfortable.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000957": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000957",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000958": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000958",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The moment Alice appeared, she was appealed to by all three to settle the question, and they repeated their arguments to her, though, as they all spoke at once, she found it very hard indeed to make out exactly what they said.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000959": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000959",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000960": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000960",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The executioner’s argument was, that you couldn’t cut off a head unless there was a body to cut it off from: that he had never had to do such a thing before, and he wasn’t going to begin at <i>his</i> time of life.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000961": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000961",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000962": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000962",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The King’s argument was, that anything that had a head could be beheaded, and that you weren’t to talk nonsense.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000963": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000963",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000964": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000964",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Queen’s argument was, that if something wasn’t done about it in less than no time she’d have everybody executed, all round. (It was this last remark that had made the whole party look so grave and anxious.)</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000965": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000965",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000966": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000966",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice could think of nothing else to say but “It belongs to the Duchess: you’d better ask <i>her</i> about it.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000967": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000967",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000968": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000968",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“She’s in prison,” the Queen said to the executioner: “fetch her here.” And the executioner went off like an arrow.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000969": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000969",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000970": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000970",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Cat’s head began fading away the moment he was gone, and, by the time he had come back with the Duchess, it had entirely disappeared; so the King and the executioner ran wildly up and down looking for it, while the rest of the party went back to the game.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000971": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000971",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000972": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000972",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000973": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000973",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><h2><a></a>CHAPTER IX.<br>\nThe Mock Turtle’s Story</h2></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000974": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000974",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000975": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000975",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You can’t think how glad I am to see you again, you dear old thing!” said the Duchess, as she tucked her arm affectionately into Alice’s, and they walked off together.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000976": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000976",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000977": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000977",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice was very glad to find her in such a pleasant temper, and thought to herself that perhaps it was only the pepper that had made her so savage when they met in the kitchen.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000978": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000978",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000979": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000979",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“When <i>I’m</i> a Duchess,” she said to herself, (not in a very hopeful tone though), “I won’t have any pepper in my kitchen <i>at all</i>. Soup does very well without—Maybe it’s always pepper that makes people hot-tempered,” she went on, very much pleased at having found out a new kind of rule, “and vinegar that makes them sour—and camomile that makes them bitter—and—and barley-sugar and such things that make children sweet-tempered. I only wish people knew <i>that</i>: then they wouldn’t be so stingy about it, you know—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000980": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000980",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000981": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000981",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>She had quite forgotten the Duchess by this time, and was a little startled when she heard her voice close to her ear. “You’re thinking about something, my dear, and that makes you forget to talk. I can’t tell you just now what the moral of that is, but I shall remember it in a bit.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000982": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000982",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000983": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000983",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Perhaps it hasn’t one,” Alice ventured to remark.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000984": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000984",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000985": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000985",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Tut, tut, child!” said the Duchess. “Everything’s got a moral, if only you can find it.” And she squeezed herself up closer to Alice’s side as she spoke.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000986": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000986",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000987": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000987",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice did not much like keeping so close to her: first, because the Duchess was <i>very</i> ugly; and secondly, because she was exactly the right height to rest her chin upon Alice’s shoulder, and it was an uncomfortably sharp chin. However, she did not like to be rude, so she bore it as well as she could.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000988": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000988",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000989": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000989",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“The game’s going on rather better now,” she said, by way of keeping up the conversation a little.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000990": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000990",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000991": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000991",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“’Tis so,” said the Duchess: “and the moral of that is—‘Oh, ’tis love, ’tis love, that makes the world go round!’”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000992": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000992",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000993": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000993",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Somebody said,” Alice whispered, “that it’s done by everybody minding their own business!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000994": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000994",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000995": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000995",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Ah, well! It means much the same thing,” said the Duchess, digging her sharp little chin into Alice’s shoulder as she added, “and the moral of <i>that</i> is—‘Take care of the sense, and the sounds will take care of themselves.’”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000996": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000996",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000997": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000997",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“How fond she is of finding morals in things!” Alice thought to herself.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000998": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000998",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000000999": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000000999",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I dare say you’re wondering why I don’t put my arm round your waist,” the Duchess said after a pause: “the reason is, that I’m doubtful about the temper of your flamingo. Shall I try the experiment?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001000": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001000",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001001": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001001",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“He might bite,” Alice cautiously replied, not feeling at all anxious to have the experiment tried.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001002": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001002",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001003": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001003",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Very true,” said the Duchess: “flamingoes and mustard both bite. And the moral of that is—‘Birds of a feather flock together.’”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001004": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001004",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001005": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001005",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Only mustard isn’t a bird,” Alice remarked.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001006": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001006",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001007": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001007",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Right, as usual,” said the Duchess: “what a clear way you have of putting things!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001008": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001008",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001009": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001009",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It’s a mineral, I <i>think</i>,” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001010": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001010",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001011": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001011",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Of course it is,” said the Duchess, who seemed ready to agree to everything that Alice said; “there’s a large mustard-mine near here. And the moral of that is—‘The more there is of mine, the less there is of yours.’”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001012": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001012",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001013": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001013",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Oh, I know!” exclaimed Alice, who had not attended to this last remark, “it’s a vegetable. It doesn’t look like one, but it is.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001014": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001014",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001015": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001015",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I quite agree with you,” said the Duchess; “and the moral of that is—‘Be what you would seem to be’—or if you’d like it put more simply—‘Never imagine yourself not to be otherwise than what it might appear to others that what you were or might have been was not otherwise than what you had been would have appeared to them to be otherwise.’”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001016": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001016",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001017": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001017",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I think I should understand that better,” Alice said very politely, “if I had it written down: but I can’t quite follow it as you say it.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001018": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001018",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001019": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001019",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“That’s nothing to what I could say if I chose,” the Duchess replied, in a pleased tone.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001020": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001020",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001021": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001021",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Pray don’t trouble yourself to say it any longer than that,” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001022": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001022",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001023": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001023",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Oh, don’t talk about trouble!” said the Duchess. “I make you a present of everything I’ve said as yet.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001024": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001024",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001025": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001025",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“A cheap sort of present!” thought Alice. “I’m glad they don’t give birthday presents like that!” But she did not venture to say it out loud.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001026": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001026",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001027": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001027",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Thinking again?” the Duchess asked, with another dig of her sharp little chin.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001028": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001028",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001029": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001029",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’ve a right to think,” said Alice sharply, for she was beginning to feel a little worried.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001030": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001030",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001031": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001031",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Just about as much right,” said the Duchess, “as pigs have to fly; and the m—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001032": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001032",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001033": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001033",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>But here, to Alice’s great surprise, the Duchess’s voice died away, even in the middle of her favourite word ‘moral,’ and the arm that was linked into hers began to tremble. Alice looked up, and there stood the Queen in front of them, with her arms folded, frowning like a thunderstorm.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001034": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001034",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001035": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001035",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“A fine day, your Majesty!” the Duchess began in a low, weak voice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001036": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001036",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001037": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001037",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Now, I give you fair warning,” shouted the Queen, stamping on the ground as she spoke; “either you or your head must be off, and that in about half no time! Take your choice!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001038": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001038",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001039": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001039",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Duchess took her choice, and was gone in a moment.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001040": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001040",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001041": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001041",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Let’s go on with the game,” the Queen said to Alice; and Alice was too much frightened to say a word, but slowly followed her back to the croquet-ground.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001042": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001042",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001043": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001043",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The other guests had taken advantage of the Queen’s absence, and were resting in the shade: however, the moment they saw her, they hurried back to the game, the Queen merely remarking that a moment’s delay would cost them their lives.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001044": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001044",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001045": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001045",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>All the time they were playing the Queen never left off quarrelling with the other players, and shouting “Off with his head!” or “Off with her head!” Those whom she sentenced were taken into custody by the soldiers, who of course had to leave off being arches to do this, so that by the end of half an hour or so there were no arches left, and all the players, except the King, the Queen, and Alice, were in custody and under sentence of execution.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001046": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001046",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001047": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001047",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Then the Queen left off, quite out of breath, and said to Alice, “Have you seen the Mock Turtle yet?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001048": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001048",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001049": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001049",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“No,” said Alice. “I don’t even know what a Mock Turtle is.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001050": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001050",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001051": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001051",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It’s the thing Mock Turtle Soup is made from,” said the Queen.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001052": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001052",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001053": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001053",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I never saw one, or heard of one,” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001054": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001054",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001055": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001055",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Come on, then,” said the Queen, “and he shall tell you his history,”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001056": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001056",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001057": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001057",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>As they walked off together, Alice heard the King say in a low voice, to the company generally, “You are all pardoned.” “Come, <i>that’s</i> a good thing!” she said to herself, for she had felt quite unhappy at the number of executions the Queen had ordered.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001058": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001058",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001059": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001059",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>They very soon came upon a Gryphon, lying fast asleep in the sun. (If you don’t know what a Gryphon is, look at the picture.) “Up, lazy thing!” said the Queen, “and take this young lady to see the Mock Turtle, and to hear his history. I must go back and see after some executions I have ordered;” and she walked off, leaving Alice alone with the Gryphon. Alice did not quite like the look of the creature, but on the whole she thought it would be quite as safe to stay with it as to go after that savage Queen: so she waited.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001060": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001060",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001061": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001061",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Gryphon sat up and rubbed its eyes: then it watched the Queen till she was out of sight: then it chuckled. “What fun!” said the Gryphon, half to itself, half to Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001062": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001062",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001063": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001063",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What <i>is</i> the fun?” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001064": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001064",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001065": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001065",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Why, <i>she</i>,” said the Gryphon. “It’s all her fancy, that: they never executes nobody, you know. Come on!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001066": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001066",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001067": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001067",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Everybody says ‘come on!’ here,” thought Alice, as she went slowly after it: “I never was so ordered about in all my life, never!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001068": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001068",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001069": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001069",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>They had not gone far before they saw the Mock Turtle in the distance, sitting sad and lonely on a little ledge of rock, and, as they came nearer, Alice could hear him sighing as if his heart would break. She pitied him deeply. “What is his sorrow?” she asked the Gryphon, and the Gryphon answered, very nearly in the same words as before, “It’s all his fancy, that: he hasn’t got no sorrow, you know. Come on!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001070": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001070",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001071": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001071",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>So they went up to the Mock Turtle, who looked at them with large eyes full of tears, but said nothing.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001072": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001072",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001073": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001073",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“This here young lady,” said the Gryphon, “she wants for to know your history, she do.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001074": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001074",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001075": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001075",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’ll tell it her,” said the Mock Turtle in a deep, hollow tone: “sit down, both of you, and don’t speak a word till I’ve finished.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001076": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001076",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001077": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001077",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>So they sat down, and nobody spoke for some minutes. Alice thought to herself, “I don’t see how he can <i>ever</i> finish, if he doesn’t begin.” But she waited patiently.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001078": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001078",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001079": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001079",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Once,” said the Mock Turtle at last, with a deep sigh, “I was a real Turtle.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001080": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001080",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001081": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001081",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>These words were followed by a very long silence, broken only by an occasional exclamation of “Hjckrrh!” from the Gryphon, and the constant heavy sobbing of the Mock Turtle. Alice was very nearly getting up and saying, “Thank you, sir, for your interesting story,” but she could not help thinking there <i>must</i> be more to come, so she sat still and said nothing.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001082": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001082",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001083": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001083",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“When we were little,” the Mock Turtle went on at last, more calmly, though still sobbing a little now and then, “we went to school in the sea. The master was an old Turtle—we used to call him Tortoise—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001084": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001084",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001085": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001085",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Why did you call him Tortoise, if he wasn’t one?” Alice asked.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001086": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001086",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001087": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001087",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“We called him Tortoise because he taught us,” said the Mock Turtle angrily: “really you are very dull!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001088": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001088",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001089": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001089",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You ought to be ashamed of yourself for asking such a simple question,” added the Gryphon; and then they both sat silent and looked at poor Alice, who felt ready to sink into the earth. At last the Gryphon said to the Mock Turtle, “Drive on, old fellow! Don’t be all day about it!” and he went on in these words:</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001090": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001090",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001091": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001091",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Yes, we went to school in the sea, though you mayn’t believe it—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001092": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001092",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001093": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001093",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I never said I didn’t!” interrupted Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001094": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001094",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001095": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001095",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You did,” said the Mock Turtle.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001096": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001096",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001097": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001097",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Hold your tongue!” added the Gryphon, before Alice could speak again. The Mock Turtle went on.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001098": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001098",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001099": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001099",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“We had the best of educations—in fact, we went to school every day—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001100": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001100",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001101": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001101",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“<i>I’ve</i> been to a day-school, too,” said Alice; “you needn’t be so proud as all that.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001102": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001102",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001103": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001103",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“With extras?” asked the Mock Turtle a little anxiously.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001104": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001104",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001105": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001105",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Yes,” said Alice, “we learned French and music.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001106": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001106",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001107": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001107",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“And washing?” said the Mock Turtle.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001108": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001108",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001109": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001109",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Certainly not!” said Alice indignantly.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001110": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001110",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001111": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001111",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Ah! then yours wasn’t a really good school,” said the Mock Turtle in a tone of great relief. “Now at <i>ours</i> they had at the end of the bill, ‘French, music, <i>and washing</i>—extra.’”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001112": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001112",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001113": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001113",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You couldn’t have wanted it much,” said Alice; “living at the bottom of the sea.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001114": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001114",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001115": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001115",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I couldn’t afford to learn it.” said the Mock Turtle with a sigh. “I only took the regular course.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001116": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001116",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001117": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001117",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What was that?” inquired Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001118": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001118",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001119": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001119",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Reeling and Writhing, of course, to begin with,” the Mock Turtle replied; “and then the different branches of Arithmetic—Ambition, Distraction, Uglification, and Derision.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001120": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001120",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001121": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001121",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I never heard of ‘Uglification,’” Alice ventured to say. “What is it?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001122": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001122",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001123": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001123",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Gryphon lifted up both its paws in surprise. “What! Never heard of uglifying!” it exclaimed. “You know what to beautify is, I suppose?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001124": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001124",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001125": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001125",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Yes,” said Alice doubtfully: “it means—to—make—anything—prettier.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001126": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001126",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001127": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001127",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, then,” the Gryphon went on, “if you don’t know what to uglify is, you <i>are</i> a simpleton.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001128": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001128",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001129": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001129",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice did not feel encouraged to ask any more questions about it, so she turned to the Mock Turtle, and said “What else had you to learn?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001130": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001130",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001131": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001131",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, there was Mystery,” the Mock Turtle replied, counting off the subjects on his flappers, “—Mystery, ancient and modern, with Seaography: then Drawling—the Drawling-master was an old conger-eel, that used to come once a week: <i>he</i> taught us Drawling, Stretching, and Fainting in Coils.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001132": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001132",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001133": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001133",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What was <i>that</i> like?” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001134": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001134",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001135": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001135",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, I can’t show it you myself,” the Mock Turtle said: “I’m too stiff. And the Gryphon never learnt it.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001136": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001136",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001137": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001137",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Hadn’t time,” said the Gryphon: “I went to the Classics master, though. He was an old crab, <i>he</i> was.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001138": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001138",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001139": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001139",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I never went to him,” the Mock Turtle said with a sigh: “he taught Laughing and Grief, they used to say.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001140": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001140",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001141": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001141",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“So he did, so he did,” said the Gryphon, sighing in his turn; and both creatures hid their faces in their paws.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001142": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001142",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001143": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001143",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“And how many hours a day did you do lessons?” said Alice, in a hurry to change the subject.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001144": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001144",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001145": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001145",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Ten hours the first day,” said the Mock Turtle: “nine the next, and so on.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001146": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001146",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001147": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001147",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What a curious plan!” exclaimed Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001148": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001148",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001149": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001149",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“That’s the reason they’re called lessons,” the Gryphon remarked: “because they lessen from day to day.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001150": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001150",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001151": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001151",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>This was quite a new idea to Alice, and she thought it over a little before she made her next remark. “Then the eleventh day must have been a holiday?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001152": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001152",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001153": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001153",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Of course it was,” said the Mock Turtle.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001154": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001154",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001155": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001155",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“And how did you manage on the twelfth?” Alice went on eagerly.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001156": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001156",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001157": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001157",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“That’s enough about lessons,” the Gryphon interrupted in a very decided tone: “tell her something about the games now.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001158": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001158",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001159": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001159",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001160": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001160",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><h2><a></a>CHAPTER X.<br>\nThe Lobster Quadrille</h2></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001161": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001161",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001162": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001162",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Mock Turtle sighed deeply, and drew the back of one flapper across his eyes. He looked at Alice, and tried to speak, but for a minute or two sobs choked his voice. “Same as if he had a bone in his throat,” said the Gryphon: and it set to work shaking him and punching him in the back. At last the Mock Turtle recovered his voice, and, with tears running down his cheeks, he went on again:—</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001163": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001163",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001164": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001164",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You may not have lived much under the sea—” (“I haven’t,” said Alice)—“and perhaps you were never even introduced to a lobster—” (Alice began to say “I once tasted—” but checked herself hastily, and said “No, never”) “—so you can have no idea what a delightful thing a Lobster Quadrille is!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001165": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001165",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001166": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001166",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“No, indeed,” said Alice. “What sort of a dance is it?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001167": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001167",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001168": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001168",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Why,” said the Gryphon, “you first form into a line along the sea-shore—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001169": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001169",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001170": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001170",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Two lines!” cried the Mock Turtle. “Seals, turtles, salmon, and so on; then, when you’ve cleared all the jelly-fish out of the way—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001171": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001171",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001172": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001172",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“<i>That</i> generally takes some time,” interrupted the Gryphon.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001173": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001173",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001174": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001174",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“—you advance twice—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001175": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001175",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001176": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001176",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Each with a lobster as a partner!” cried the Gryphon.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001177": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001177",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001178": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001178",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Of course,” the Mock Turtle said: “advance twice, set to partners—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001179": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001179",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001180": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001180",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“—change lobsters, and retire in same order,” continued the Gryphon.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001181": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001181",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001182": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001182",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Then, you know,” the Mock Turtle went on, “you throw the—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001183": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001183",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001184": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001184",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“The lobsters!” shouted the Gryphon, with a bound into the air.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001185": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001185",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001186": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001186",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“—as far out to sea as you can—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001187": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001187",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001188": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001188",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Swim after them!” screamed the Gryphon.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001189": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001189",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001190": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001190",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Turn a somersault in the sea!” cried the Mock Turtle, capering wildly about.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001191": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001191",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001192": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001192",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Change lobsters again!” yelled the Gryphon at the top of its voice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001193": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001193",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001194": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001194",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Back to land again, and that’s all the first figure,” said the Mock Turtle, suddenly dropping his voice; and the two creatures, who had been jumping about like mad things all this time, sat down again very sadly and quietly, and looked at Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001195": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001195",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001196": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001196",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It must be a very pretty dance,” said Alice timidly.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001197": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001197",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001198": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001198",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Would you like to see a little of it?” said the Mock Turtle.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001199": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001199",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001200": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001200",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Very much indeed,” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001201": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001201",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001202": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001202",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Come, let’s try the first figure!” said the Mock Turtle to the Gryphon. “We can do without lobsters, you know. Which shall sing?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001203": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001203",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001204": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001204",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Oh, <i>you</i> sing,” said the Gryphon. “I’ve forgotten the words.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001205": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001205",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001206": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001206",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>So they began solemnly dancing round and round Alice, every now and then treading on her toes when they passed too close, and waving their forepaws to mark the time, while the Mock Turtle sang this, very slowly and sadly:—</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001207": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001207",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001208": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001208",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"poem\">“Will you walk a little faster?” said a whiting to a snail.<br>\n“There’s a porpoise close behind us, and he’s treading on my tail.<br>\nSee how eagerly the lobsters and the turtles all advance!<br>\nThey are waiting on the shingle—will you come and join the dance?<br>\nWill you, won’t you, will you, won’t you, will you join the dance?<br>\nWill you, won’t you, will you, won’t you, won’t you join the dance?<br>\n<br>\n“You can really have no notion how delightful it will be<br>\nWhen they take us up and throw us, with the lobsters, out to sea!”<br>\nBut the snail replied “Too far, too far!” and gave a look askance—<br>\nSaid he thanked the whiting kindly, but he would not join the dance.<br>\nWould not, could not, would not, could not, would not join the dance.<br>\nWould not, could not, would not, could not, could not join the dance.<br>\n<br>\n“What matters it how far we go?” his scaly friend replied.<br>\n“There is another shore, you know, upon the other side.<br>\nThe further off from England the nearer is to France—<br>\nThen turn not pale, beloved snail, but come and join the dance.<br>\nWill you, won’t you, will you, won’t you, will you join the dance?<br>\nWill you, won’t you, will you, won’t you, won’t you join the dance?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001209": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001209",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001210": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001210",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Thank you, it’s a very interesting dance to watch,” said Alice, feeling very glad that it was over at last: “and I do so like that curious song about the whiting!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001211": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001211",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001212": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001212",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Oh, as to the whiting,” said the Mock Turtle, “they—you’ve seen them, of course?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001213": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001213",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001214": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001214",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Yes,” said Alice, “I’ve often seen them at dinn—” she checked herself hastily.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001215": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001215",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001216": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001216",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I don’t know where Dinn may be,” said the Mock Turtle, “but if you’ve seen them so often, of course you know what they’re like.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001217": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001217",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001218": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001218",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I believe so,” Alice replied thoughtfully. “They have their tails in their mouths—and they’re all over crumbs.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001219": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001219",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001220": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001220",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You’re wrong about the crumbs,” said the Mock Turtle: “crumbs would all wash off in the sea. But they <i>have</i> their tails in their mouths; and the reason is—” here the Mock Turtle yawned and shut his eyes.—“Tell her about the reason and all that,” he said to the Gryphon.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001221": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001221",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001222": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001222",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“The reason is,” said the Gryphon, “that they <i>would</i> go with the lobsters to the dance. So they got thrown out to sea. So they had to fall a long way. So they got their tails fast in their mouths. So they couldn’t get them out again. That’s all.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001223": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001223",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001224": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001224",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Thank you,” said Alice, “it’s very interesting. I never knew so much about a whiting before.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001225": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001225",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001226": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001226",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I can tell you more than that, if you like,” said the Gryphon. “Do you know why it’s called a whiting?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001227": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001227",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001228": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001228",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I never thought about it,” said Alice. “Why?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001229": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001229",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001230": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001230",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“<i>It does the boots and shoes</i>,” the Gryphon replied very solemnly.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001231": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001231",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001232": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001232",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice was thoroughly puzzled. “Does the boots and shoes!” she repeated in a wondering tone.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001233": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001233",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001234": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001234",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Why, what are <i>your</i> shoes done with?” said the Gryphon. “I mean, what makes them so shiny?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001235": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001235",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001236": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001236",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice looked down at them, and considered a little before she gave her answer. “They’re done with blacking, I believe.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001237": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001237",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001238": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001238",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Boots and shoes under the sea,” the Gryphon went on in a deep voice, “are done with a whiting. Now you know.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001239": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001239",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001240": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001240",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“And what are they made of?” Alice asked in a tone of great curiosity.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001241": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001241",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001242": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001242",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Soles and eels, of course,” the Gryphon replied rather impatiently: “any shrimp could have told you that.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001243": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001243",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001244": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001244",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“If I’d been the whiting,” said Alice, whose thoughts were still running on the song, “I’d have said to the porpoise, ‘Keep back, please: we don’t want <i>you</i> with us!’”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001245": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001245",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001246": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001246",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“They were obliged to have him with them,” the Mock Turtle said: “no wise fish would go anywhere without a porpoise.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001247": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001247",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001248": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001248",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Wouldn’t it really?” said Alice in a tone of great surprise.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001249": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001249",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001250": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001250",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Of course not,” said the Mock Turtle: “why, if a fish came to <i>me</i>, and told me he was going a journey, I should say ‘With what porpoise?’”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001251": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001251",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001252": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001252",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Don’t you mean ‘purpose’?” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001253": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001253",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001254": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001254",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I mean what I say,” the Mock Turtle replied in an offended tone. And the Gryphon added “Come, let’s hear some of <i>your</i> adventures.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001255": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001255",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001256": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001256",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I could tell you my adventures—beginning from this morning,” said Alice a little timidly: “but it’s no use going back to yesterday, because I was a different person then.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001257": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001257",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001258": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001258",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Explain all that,” said the Mock Turtle.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001259": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001259",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001260": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001260",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“No, no! The adventures first,” said the Gryphon in an impatient tone: “explanations take such a dreadful time.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001261": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001261",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001262": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001262",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>So Alice began telling them her adventures from the time when she first saw the White Rabbit. She was a little nervous about it just at first, the two creatures got so close to her, one on each side, and opened their eyes and mouths so <i>very</i> wide, but she gained courage as she went on. Her listeners were perfectly quiet till she got to the part about her repeating “<i>You are old, Father William</i>,” to the Caterpillar, and the words all coming different, and then the Mock Turtle drew a long breath, and said “That’s very curious.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001263": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001263",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001264": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001264",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It’s all about as curious as it can be,” said the Gryphon.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001265": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001265",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001266": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001266",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It all came different!” the Mock Turtle repeated thoughtfully. “I should like to hear her try and repeat something now. Tell her to begin.” He looked at the Gryphon as if he thought it had some kind of authority over Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001267": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001267",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001268": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001268",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Stand up and repeat ‘’<i>Tis the voice of the sluggard</i>,’” said the Gryphon.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001269": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001269",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001270": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001270",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“How the creatures order one about, and make one repeat lessons!” thought Alice; “I might as well be at school at once.” However, she got up, and began to repeat it, but her head was so full of the Lobster Quadrille, that she hardly knew what she was saying, and the words came very queer indeed:—</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001271": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001271",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001272": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001272",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"poem\">“’Tis the voice of the Lobster; I heard him declare,<br>\n“You have baked me too brown, I must sugar my hair.”<br>\nAs a duck with its eyelids, so he with his nose<br>\nTrims his belt and his buttons, and turns out his toes.”<br>\n<br>\n[later editions continued as follows<br>\nWhen the sands are all dry, he is gay as a lark,<br>\nAnd will talk in contemptuous tones of the Shark,<br>\nBut, when the tide rises and sharks are around,<br>\nHis voice has a timid and tremulous sound.]</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001273": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001273",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001274": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001274",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“That’s different from what <i>I</i> used to say when I was a child,” said the Gryphon.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001275": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001275",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001276": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001276",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, I never heard it before,” said the Mock Turtle; “but it sounds uncommon nonsense.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001277": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001277",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001278": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001278",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice said nothing; she had sat down with her face in her hands, wondering if anything would <i>ever</i> happen in a natural way again.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001279": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001279",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001280": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001280",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I should like to have it explained,” said the Mock Turtle.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001281": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001281",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001282": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001282",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“She can’t explain it,” said the Gryphon hastily. “Go on with the next verse.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001283": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001283",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001284": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001284",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“But about his toes?” the Mock Turtle persisted. “How <i>could</i> he turn them out with his nose, you know?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001285": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001285",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001286": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001286",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It’s the first position in dancing.” Alice said; but was dreadfully puzzled by the whole thing, and longed to change the subject.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001287": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001287",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001288": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001288",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Go on with the next verse,” the Gryphon repeated impatiently: “it begins ‘<i>I passed by his garden</i>.’”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001289": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001289",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001290": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001290",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice did not dare to disobey, though she felt sure it would all come wrong, and she went on in a trembling voice:—</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001291": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001291",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001292": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001292",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"poem\">“I passed by his garden, and marked, with one eye,<br>\nHow the Owl and the Panther were sharing a pie—”<br>\n<br>\n[later editions continued as follows<br>\nThe Panther took pie-crust, and gravy, and meat,<br>\nWhile the Owl had the dish as its share of the treat.<br>\nWhen the pie was all finished, the Owl, as a boon,<br>\nWas kindly permitted to pocket the spoon:<br>\nWhile the Panther received knife and fork with a growl,<br>\nAnd concluded the banquet—]</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001293": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001293",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001294": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001294",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What <i>is</i> the use of repeating all that stuff,” the Mock Turtle interrupted, “if you don’t explain it as you go on? It’s by far the most confusing thing <i>I</i> ever heard!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001295": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001295",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001296": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001296",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Yes, I think you’d better leave off,” said the Gryphon: and Alice was only too glad to do so.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001297": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001297",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001298": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001298",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Shall we try another figure of the Lobster Quadrille?” the Gryphon went on. “Or would you like the Mock Turtle to sing you a song?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001299": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001299",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001300": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001300",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Oh, a song, please, if the Mock Turtle would be so kind,” Alice replied, so eagerly that the Gryphon said, in a rather offended tone, “Hm! No accounting for tastes! Sing her ‘<i>Turtle Soup</i>,’ will you, old fellow?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001301": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001301",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001302": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001302",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Mock Turtle sighed deeply, and began, in a voice sometimes choked with sobs, to sing this:—</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001303": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001303",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001304": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001304",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"poem\">“Beautiful Soup, so rich and green,<br>\nWaiting in a hot tureen!<br>\nWho for such dainties would not stoop?<br>\nSoup of the evening, beautiful Soup!<br>\nSoup of the evening, beautiful Soup!<br>\n    Beau—ootiful Soo—oop!<br>\n    Beau—ootiful Soo—oop!<br>\nSoo—oop of the e—e—evening,<br>\n    Beautiful, beautiful Soup!<br>\n<br>\n“Beautiful Soup! Who cares for fish,<br>\nGame, or any other dish?<br>\nWho would not give all else for two p<br>\nennyworth only of beautiful Soup?<br>\nPennyworth only of beautiful Soup?<br>\n    Beau—ootiful Soo—oop!<br>\n    Beau—ootiful Soo—oop!<br>\nSoo—oop of the e—e—evening,<br>\n    Beautiful, beauti—FUL SOUP!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001305": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001305",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001306": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001306",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Chorus again!” cried the Gryphon, and the Mock Turtle had just begun to repeat it, when a cry of “The trial’s beginning!” was heard in the distance.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001307": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001307",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001308": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001308",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Come on!” cried the Gryphon, and, taking Alice by the hand, it hurried off, without waiting for the end of the song.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001309": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001309",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001310": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001310",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What trial is it?” Alice panted as she ran; but the Gryphon only answered “Come on!” and ran the faster, while more and more faintly came, carried on the breeze that followed them, the melancholy words:—</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001311": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001311",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001312": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001312",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"poem\">“Soo—oop of the e—e—evening,<br>\n    Beautiful, beautiful Soup!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001313": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001313",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001314": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001314",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001315": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001315",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><h2><a></a>CHAPTER XI.<br>\nWho Stole the Tarts?</h2></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001316": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001316",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001317": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001317",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The King and Queen of Hearts were seated on their throne when they arrived, with a great crowd assembled about them—all sorts of little birds and beasts, as well as the whole pack of cards: the Knave was standing before them, in chains, with a soldier on each side to guard him; and near the King was the White Rabbit, with a trumpet in one hand, and a scroll of parchment in the other. In the very middle of the court was a table, with a large dish of tarts upon it: they looked so good, that it made Alice quite hungry to look at them—“I wish they’d get the trial done,” she thought, “and hand round the refreshments!” But there seemed to be no chance of this, so she began looking at everything about her, to pass away the time.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001318": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001318",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001319": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001319",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice had never been in a court of justice before, but she had read about them in books, and she was quite pleased to find that she knew the name of nearly everything there. “That’s the judge,” she said to herself, “because of his great wig.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001320": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001320",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001321": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001321",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The judge, by the way, was the King; and as he wore his crown over the wig, (look at the frontispiece if you want to see how he did it,) he did not look at all comfortable, and it was certainly not becoming.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001322": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001322",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001323": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001323",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“And that’s the jury-box,” thought Alice, “and those twelve creatures,” (she was obliged to say “creatures,” you see, because some of them were animals, and some were birds,) “I suppose they are the jurors.” She said this last word two or three times over to herself, being rather proud of it: for she thought, and rightly too, that very few little girls of her age knew the meaning of it at all. However, “jury-men” would have done just as well.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001324": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001324",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001325": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001325",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The twelve jurors were all writing very busily on slates. “What are they doing?” Alice whispered to the Gryphon. “They can’t have anything to put down yet, before the trial’s begun.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001326": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001326",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001327": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001327",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“They’re putting down their names,” the Gryphon whispered in reply, “for fear they should forget them before the end of the trial.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001328": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001328",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001329": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001329",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Stupid things!” Alice began in a loud, indignant voice, but she stopped hastily, for the White Rabbit cried out, “Silence in the court!” and the King put on his spectacles and looked anxiously round, to make out who was talking.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001330": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001330",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001331": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001331",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice could see, as well as if she were looking over their shoulders, that all the jurors were writing down “stupid things!” on their slates, and she could even make out that one of them didn’t know how to spell “stupid,” and that he had to ask his neighbour to tell him. “A nice muddle their slates’ll be in before the trial’s over!” thought Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001332": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001332",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001333": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001333",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>One of the jurors had a pencil that squeaked. This of course, Alice could <i>not</i> stand, and she went round the court and got behind him, and very soon found an opportunity of taking it away. She did it so quickly that the poor little juror (it was Bill, the Lizard) could not make out at all what had become of it; so, after hunting all about for it, he was obliged to write with one finger for the rest of the day; and this was of very little use, as it left no mark on the slate.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001334": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001334",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001335": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001335",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Herald, read the accusation!” said the King.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001336": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001336",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001337": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001337",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>On this the White Rabbit blew three blasts on the trumpet, and then unrolled the parchment scroll, and read as follows:—</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001338": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001338",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001339": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001339",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"poem\">“The Queen of Hearts, she made some tarts,<br>\n    All on a summer day:<br>\nThe Knave of Hearts, he stole those tarts,<br>\n    And took them quite away!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001340": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001340",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001341": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001341",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Consider your verdict,” the King said to the jury.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001342": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001342",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001343": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001343",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Not yet, not yet!” the Rabbit hastily interrupted. “There’s a great deal to come before that!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001344": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001344",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001345": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001345",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Call the first witness,” said the King; and the White Rabbit blew three blasts on the trumpet, and called out, “First witness!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001346": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001346",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001347": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001347",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The first witness was the Hatter. He came in with a teacup in one hand and a piece of bread-and-butter in the other. “I beg pardon, your Majesty,” he began, “for bringing these in: but I hadn’t quite finished my tea when I was sent for.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001348": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001348",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001349": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001349",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You ought to have finished,” said the King. “When did you begin?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001350": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001350",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001351": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001351",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Hatter looked at the March Hare, who had followed him into the court, arm-in-arm with the Dormouse. “Fourteenth of March, I <i>think</i> it was,” he said.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001352": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001352",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001353": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001353",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Fifteenth,” said the March Hare.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001354": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001354",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001355": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001355",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Sixteenth,” added the Dormouse.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001356": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001356",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001357": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001357",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Write that down,” the King said to the jury, and the jury eagerly wrote down all three dates on their slates, and then added them up, and reduced the answer to shillings and pence.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001358": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001358",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001359": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001359",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Take off your hat,” the King said to the Hatter.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001360": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001360",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001361": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001361",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It isn’t mine,” said the Hatter.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001362": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001362",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001363": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001363",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“<i>Stolen!</i>” the King exclaimed, turning to the jury, who instantly made a memorandum of the fact.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001364": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001364",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001365": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001365",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I keep them to sell,” the Hatter added as an explanation; “I’ve none of my own. I’m a hatter.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001366": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001366",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001367": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001367",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Here the Queen put on her spectacles, and began staring at the Hatter, who turned pale and fidgeted.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001368": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001368",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001369": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001369",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Give your evidence,” said the King; “and don’t be nervous, or I’ll have you executed on the spot.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001370": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001370",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001371": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001371",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>This did not seem to encourage the witness at all: he kept shifting from one foot to the other, looking uneasily at the Queen, and in his confusion he bit a large piece out of his teacup instead of the bread-and-butter.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001372": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001372",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001373": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001373",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Just at this moment Alice felt a very curious sensation, which puzzled her a good deal until she made out what it was: she was beginning to grow larger again, and she thought at first she would get up and leave the court; but on second thoughts she decided to remain where she was as long as there was room for her.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001374": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001374",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001375": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001375",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I wish you wouldn’t squeeze so.” said the Dormouse, who was sitting next to her. “I can hardly breathe.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001376": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001376",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001377": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001377",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I can’t help it,” said Alice very meekly: “I’m growing.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001378": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001378",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001379": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001379",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You’ve no right to grow <i>here</i>,” said the Dormouse.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001380": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001380",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001381": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001381",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Don’t talk nonsense,” said Alice more boldly: “you know you’re growing too.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001382": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001382",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001383": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001383",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Yes, but <i>I</i> grow at a reasonable pace,” said the Dormouse: “not in that ridiculous fashion.” And he got up very sulkily and crossed over to the other side of the court.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001384": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001384",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001385": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001385",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>All this time the Queen had never left off staring at the Hatter, and, just as the Dormouse crossed the court, she said to one of the officers of the court, “Bring me the list of the singers in the last concert!” on which the wretched Hatter trembled so, that he shook both his shoes off.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001386": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001386",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001387": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001387",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Give your evidence,” the King repeated angrily, “or I’ll have you executed, whether you’re nervous or not.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001388": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001388",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001389": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001389",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’m a poor man, your Majesty,” the Hatter began, in a trembling voice, “—and I hadn’t begun my tea—not above a week or so—and what with the bread-and-butter getting so thin—and the twinkling of the tea—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001390": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001390",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001391": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001391",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“The twinkling of the <i>what?</i>” said the King.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001392": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001392",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001393": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001393",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It <i>began</i> with the tea,” the Hatter replied.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001394": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001394",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001395": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001395",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Of course twinkling begins with a T!” said the King sharply. “Do you take me for a dunce? Go on!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001396": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001396",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001397": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001397",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’m a poor man,” the Hatter went on, “and most things twinkled after that—only the March Hare said—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001398": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001398",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001399": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001399",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I didn’t!” the March Hare interrupted in a great hurry.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001400": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001400",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001401": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001401",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You did!” said the Hatter.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001402": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001402",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001403": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001403",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I deny it!” said the March Hare.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001404": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001404",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001405": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001405",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“He denies it,” said the King: “leave out that part.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001406": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001406",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001407": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001407",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, at any rate, the Dormouse said—” the Hatter went on, looking anxiously round to see if he would deny it too: but the Dormouse denied nothing, being fast asleep.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001408": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001408",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001409": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001409",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“After that,” continued the Hatter, “I cut some more bread-and-butter—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001410": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001410",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001411": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001411",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“But what did the Dormouse say?” one of the jury asked.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001412": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001412",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001413": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001413",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“That I can’t remember,” said the Hatter.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001414": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001414",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001415": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001415",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You <i>must</i> remember,” remarked the King, “or I’ll have you executed.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001416": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001416",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001417": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001417",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The miserable Hatter dropped his teacup and bread-and-butter, and went down on one knee. “I’m a poor man, your Majesty,” he began.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001418": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001418",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001419": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001419",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You’re a <i>very</i> poor <i>speaker</i>,” said the King.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001420": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001420",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001421": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001421",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Here one of the guinea-pigs cheered, and was immediately suppressed by the officers of the court. (As that is rather a hard word, I will just explain to you how it was done. They had a large canvas bag, which tied up at the mouth with strings: into this they slipped the guinea-pig, head first, and then sat upon it.)</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001422": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001422",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001423": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001423",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’m glad I’ve seen that done,” thought Alice. “I’ve so often read in the newspapers, at the end of trials, “There was some attempts at applause, which was immediately suppressed by the officers of the court,” and I never understood what it meant till now.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001424": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001424",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001425": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001425",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“If that’s all you know about it, you may stand down,” continued the King.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001426": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001426",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001427": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001427",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I can’t go no lower,” said the Hatter: “I’m on the floor, as it is.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001428": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001428",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001429": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001429",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Then you may <i>sit</i> down,” the King replied.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001430": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001430",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001431": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001431",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Here the other guinea-pig cheered, and was suppressed.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001432": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001432",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001433": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001433",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Come, that finished the guinea-pigs!” thought Alice. “Now we shall get on better.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001434": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001434",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001435": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001435",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I’d rather finish my tea,” said the Hatter, with an anxious look at the Queen, who was reading the list of singers.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001436": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001436",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001437": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001437",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You may go,” said the King, and the Hatter hurriedly left the court, without even waiting to put his shoes on.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001438": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001438",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001439": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001439",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“—and just take his head off outside,” the Queen added to one of the officers: but the Hatter was out of sight before the officer could get to the door.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001440": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001440",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001441": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001441",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Call the next witness!” said the King.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001442": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001442",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001443": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001443",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The next witness was the Duchess’s cook. She carried the pepper-box in her hand, and Alice guessed who it was, even before she got into the court, by the way the people near the door began sneezing all at once.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001444": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001444",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001445": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001445",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Give your evidence,” said the King.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001446": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001446",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001447": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001447",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Shan’t,” said the cook.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001448": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001448",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001449": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001449",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The King looked anxiously at the White Rabbit, who said in a low voice, “Your Majesty must cross-examine <i>this</i> witness.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001450": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001450",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001451": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001451",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, if I must, I must,” the King said, with a melancholy air, and, after folding his arms and frowning at the cook till his eyes were nearly out of sight, he said in a deep voice, “What are tarts made of?”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001452": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001452",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001453": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001453",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Pepper, mostly,” said the cook.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001454": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001454",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001455": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001455",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Treacle,” said a sleepy voice behind her.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001456": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001456",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001457": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001457",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Collar that Dormouse,” the Queen shrieked out. “Behead that Dormouse! Turn that Dormouse out of court! Suppress him! Pinch him! Off with his whiskers!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001458": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001458",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001459": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001459",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>For some minutes the whole court was in confusion, getting the Dormouse turned out, and, by the time they had settled down again, the cook had disappeared.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001460": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001460",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001461": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001461",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Never mind!” said the King, with an air of great relief. “Call the next witness.” And he added in an undertone to the Queen, “Really, my dear, <i>you</i> must cross-examine the next witness. It quite makes my forehead ache!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001462": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001462",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001463": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001463",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice watched the White Rabbit as he fumbled over the list, feeling very curious to see what the next witness would be like, “—for they haven’t got much evidence <i>yet</i>,” she said to herself. Imagine her surprise, when the White Rabbit read out, at the top of his shrill little voice, the name “Alice!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001464": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001464",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001465": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001465",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001466": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001466",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><h2><a></a>CHAPTER XII.<br>\nAlice’s Evidence</h2></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001467": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001467",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001468": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001468",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Here!” cried Alice, quite forgetting in the flurry of the moment how large she had grown in the last few minutes, and she jumped up in such a hurry that she tipped over the jury-box with the edge of her skirt, upsetting all the jurymen on to the heads of the crowd below, and there they lay sprawling about, reminding her very much of a globe of goldfish she had accidentally upset the week before.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001469": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001469",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001470": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001470",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Oh, I <i>beg</i> your pardon!” she exclaimed in a tone of great dismay, and began picking them up again as quickly as she could, for the accident of the goldfish kept running in her head, and she had a vague sort of idea that they must be collected at once and put back into the jury-box, or they would die.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001471": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001471",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001472": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001472",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“The trial cannot proceed,” said the King in a very grave voice, “until all the jurymen are back in their proper places—<i>all</i>,” he repeated with great emphasis, looking hard at Alice as he said so.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001473": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001473",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001474": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001474",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Alice looked at the jury-box, and saw that, in her haste, she had put the Lizard in head downwards, and the poor little thing was waving its tail about in a melancholy way, being quite unable to move. She soon got it out again, and put it right; “not that it signifies much,” she said to herself; “I should think it would be <i>quite</i> as much use in the trial one way up as the other.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001475": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001475",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001476": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001476",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>As soon as the jury had a little recovered from the shock of being upset, and their slates and pencils had been found and handed back to them, they set to work very diligently to write out a history of the accident, all except the Lizard, who seemed too much overcome to do anything but sit with its mouth open, gazing up into the roof of the court.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001477": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001477",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001478": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001478",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What do you know about this business?” the King said to Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001479": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001479",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001480": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001480",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Nothing,” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001481": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001481",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001482": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001482",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Nothing <i>whatever?</i>” persisted the King.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001483": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001483",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001484": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001484",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Nothing whatever,” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001485": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001485",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001486": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001486",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“That’s very important,” the King said, turning to the jury. They were just beginning to write this down on their slates, when the White Rabbit interrupted: “<i>Un</i>important, your Majesty means, of course,” he said in a very respectful tone, but frowning and making faces at him as he spoke.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001487": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001487",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001488": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001488",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“<i>Un</i>important, of course, I meant,” the King hastily said, and went on to himself in an undertone,</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001489": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001489",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001490": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001490",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“important—unimportant—unimportant—important—” as if he were trying which word sounded best.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001491": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001491",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001492": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001492",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Some of the jury wrote it down “important,” and some “unimportant.” Alice could see this, as she was near enough to look over their slates; “but it doesn’t matter a bit,” she thought to herself.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001493": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001493",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001494": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001494",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>At this moment the King, who had been for some time busily writing in his note-book, cackled out “Silence!” and read out from his book, “Rule Forty-two. <i>All persons more than a mile high to leave the court</i>.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001495": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001495",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001496": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001496",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Everybody looked at Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001497": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001497",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001498": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001498",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“<i>I’m</i> not a mile high,” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001499": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001499",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001500": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001500",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“You are,” said the King.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001501": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001501",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001502": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001502",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Nearly two miles high,” added the Queen.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001503": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001503",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001504": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001504",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Well, I shan’t go, at any rate,” said Alice: “besides, that’s not a regular rule: you invented it just now.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001505": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001505",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001506": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001506",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It’s the oldest rule in the book,” said the King.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001507": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001507",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001508": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001508",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Then it ought to be Number One,” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001509": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001509",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001510": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001510",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The King turned pale, and shut his note-book hastily. “Consider your verdict,” he said to the jury, in a low, trembling voice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001511": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001511",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001512": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001512",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“There’s more evidence to come yet, please your Majesty,” said the White Rabbit, jumping up in a great hurry; “this paper has just been picked up.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001513": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001513",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001514": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001514",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“What’s in it?” said the Queen.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001515": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001515",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001516": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001516",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I haven’t opened it yet,” said the White Rabbit, “but it seems to be a letter, written by the prisoner to—to somebody.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001517": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001517",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001518": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001518",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It must have been that,” said the King, “unless it was written to nobody, which isn’t usual, you know.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001519": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001519",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001520": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001520",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Who is it directed to?” said one of the jurymen.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001521": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001521",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001522": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001522",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It isn’t directed at all,” said the White Rabbit; “in fact, there’s nothing written on the <i>outside</i>.” He unfolded the paper as he spoke, and added “It isn’t a letter, after all: it’s a set of verses.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001523": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001523",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001524": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001524",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Are they in the prisoner’s handwriting?” asked another of the jurymen.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001525": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001525",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001526": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001526",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“No, they’re not,” said the White Rabbit, “and that’s the queerest thing about it.” (The jury all looked puzzled.)</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001527": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001527",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001528": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001528",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“He must have imitated somebody else’s hand,” said the King. (The jury all brightened up again.)</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001529": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001529",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001530": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001530",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Please your Majesty,” said the Knave, “I didn’t write it, and they can’t prove I did: there’s no name signed at the end.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001531": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001531",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001532": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001532",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“If you didn’t sign it,” said the King, “that only makes the matter worse. You <i>must</i> have meant some mischief, or else you’d have signed your name like an honest man.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001533": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001533",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001534": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001534",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>There was a general clapping of hands at this: it was the first really clever thing the King had said that day.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001535": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001535",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001536": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001536",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“That <i>proves</i> his guilt,” said the Queen.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001537": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001537",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001538": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001538",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It proves nothing of the sort!” said Alice. “Why, you don’t even know what they’re about!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001539": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001539",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001540": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001540",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Read them,” said the King.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001541": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001541",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001542": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001542",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The White Rabbit put on his spectacles. “Where shall I begin, please your Majesty?” he asked.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001543": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001543",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001544": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001544",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Begin at the beginning,” the King said gravely, “and go on till you come to the end: then stop.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001545": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001545",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001546": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001546",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>These were the verses the White Rabbit read:—</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001547": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001547",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001548": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001548",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p class=\"poem\">“They told me you had been to her,<br>\n    And mentioned me to him:<br>\nShe gave me a good character,<br>\n    But said I could not swim.<br>\n<br>\nHe sent them word I had not gone<br>\n    (We know it to be true):<br>\nIf she should push the matter on,<br>\n    What would become of you?<br>\n<br>\nI gave her one, they gave him two,<br>\n    You gave us three or more;<br>\nThey all returned from him to you,<br>\n    Though they were mine before.<br>\n<br>\nIf I or she should chance to be<br>\n    Involved in this affair,<br>\nHe trusts to you to set them free,<br>\n    Exactly as we were.<br>\n<br>\nMy notion was that you had been<br>\n    (Before she had this fit)<br>\nAn obstacle that came between<br>\n    Him, and ourselves, and it.<br>\n<br>\nDon’t let him know she liked them best,<br>\n    For this must ever be<br>\nA secret, kept from all the rest,<br>\n    Between yourself and me.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001549": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001549",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001550": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001550",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“That’s the most important piece of evidence we’ve heard yet,” said the King, rubbing his hands; “so now let the jury—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001551": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001551",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001552": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001552",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“If any one of them can explain it,” said Alice, (she had grown so large in the last few minutes that she wasn’t a bit afraid of interrupting him,) “I’ll give him sixpence. <i>I</i> don’t believe there’s an atom of meaning in it.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001553": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001553",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001554": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001554",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The jury all wrote down on their slates, “<i>She</i> doesn’t believe there’s an atom of meaning in it,” but none of them attempted to explain the paper.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001555": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001555",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001556": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001556",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“If there’s no meaning in it,” said the King, “that saves a world of trouble, you know, as we needn’t try to find any. And yet I don’t know,” he went on, spreading out the verses on his knee, and looking at them with one eye; “I seem to see some meaning in them, after all. “—<i>said I could not swim</i>—” you can’t swim, can you?” he added, turning to the Knave.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001557": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001557",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001558": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001558",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The Knave shook his head sadly. “Do I look like it?” he said. (Which he certainly did <i>not</i>, being made entirely of cardboard.)</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001559": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001559",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001560": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001560",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“All right, so far,” said the King, and he went on muttering over the verses to himself: “‘<i>We know it to be true</i>—’ that’s the jury, of course—‘<i>I gave her one, they gave him two</i>—’ why, that must be what he did with the tarts, you know—”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001561": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001561",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001562": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001562",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“But, it goes on ‘<i>they all returned from him to you</i>,’” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001563": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001563",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001564": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001564",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Why, there they are!” said the King triumphantly, pointing to the tarts on the table. “Nothing can be clearer than <i>that</i>. Then again—‘<i>before she had this fit</i>—’ you never had fits, my dear, I think?” he said to the Queen.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001565": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001565",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001566": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001566",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Never!” said the Queen furiously, throwing an inkstand at the Lizard as she spoke. (The unfortunate little Bill had left off writing on his slate with one finger, as he found it made no mark; but he now hastily began again, using the ink, that was trickling down his face, as long as it lasted.)</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001567": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001567",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001568": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001568",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Then the words don’t <i>fit</i> you,” said the King, looking round the court with a smile. There was a dead silence.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001569": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001569",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001570": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001570",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“It’s a pun!” the King added in an offended tone, and everybody laughed, “Let the jury consider their verdict,” the King said, for about the twentieth time that day.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001571": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001571",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001572": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001572",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“No, no!” said the Queen. “Sentence first—verdict afterwards.”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001573": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001573",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001574": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001574",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Stuff and nonsense!” said Alice loudly. “The idea of having the sentence first!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001575": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001575",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001576": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001576",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Hold your tongue!” said the Queen, turning purple.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001577": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001577",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001578": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001578",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“I won’t!” said Alice.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001579": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001579",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001580": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001580",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Off with her head!” the Queen shouted at the top of her voice. Nobody moved.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001581": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001581",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001582": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001582",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Who cares for you?” said Alice, (she had grown to her full size by this time.) “You’re nothing but a pack of cards!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001583": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001583",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001584": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001584",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>At this the whole pack rose up into the air, and came flying down upon her: she gave a little scream, half of fright and half of anger, and tried to beat them off, and found herself lying on the bank, with her head in the lap of her sister, who was gently brushing away some dead leaves that had fluttered down from the trees upon her face.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001585": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001585",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001586": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001586",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Wake up, Alice dear!” said her sister; “Why, what a long sleep you’ve had!”</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001587": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001587",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001588": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001588",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>“Oh, I’ve had such a curious dream!” said Alice, and she told her sister, as well as she could remember them, all these strange Adventures of hers that you have just been reading about; and when she had finished, her sister kissed her, and said, “It <i>was</i> a curious dream, dear, certainly: but now run in to your tea; it’s getting late.” So Alice got up and ran off, thinking while she ran, as well she might, what a wonderful dream it had been.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001589": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001589",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001590": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001590",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>But her sister sat still just as she left her, leaning her head on her hand, watching the setting sun, and thinking of little Alice and all her wonderful Adventures, till she too began dreaming after a fashion, and this was her dream:—</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001591": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001591",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001592": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001592",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>First, she dreamed of little Alice herself, and once again the tiny hands were clasped upon her knee, and the bright eager eyes were looking up into hers—she could hear the very tones of her voice, and see that queer little toss of her head to keep back the wandering hair that <i>would</i> always get into her eyes—and still as she listened, or seemed to listen, the whole place around her became alive with the strange creatures of her little sister’s dream.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001593": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001593",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001594": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001594",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>The long grass rustled at her feet as the White Rabbit hurried by—the frightened Mouse splashed his way through the neighbouring pool—she could hear the rattle of the teacups as the March Hare and his friends shared their never-ending meal, and the shrill voice of the Queen ordering off her unfortunate guests to execution—once more the pig-baby was sneezing on the Duchess’s knee, while plates and dishes crashed around it—once more the shriek of the Gryphon, the squeaking of the Lizard’s slate-pencil, and the choking of the suppressed guinea-pigs, filled the air, mixed up with the distant sobs of the miserable Mock Turtle.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001595": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001595",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001596": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001596",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>So she sat on, with closed eyes, and half believed herself in Wonderland, though she knew she had but to open them again, and all would change to dull reality—the grass would be only rustling in the wind, and the pool rippling to the waving of the reeds—the rattling teacups would change to tinkling sheep-bells, and the Queen’s shrill cries to the voice of the shepherd boy—and the sneeze of the baby, the shriek of the Gryphon, and all the other queer noises, would change (she knew) to the confused clamour of the busy farm-yard—while the lowing of the cattle in the distance would take the place of the Mock Turtle’s heavy sobs.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001597": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001597",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001598": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001598",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><p>Lastly, she pictured to herself how this same little sister of hers would, in the after-time, be herself a grown woman; and how she would keep, through all her riper years, the simple and loving heart of her childhood: and how she would gather about her other little children, and make <i>their</i> eyes bright and eager with many a strange tale, perhaps even with the dream of Wonderland of long ago: and how she would feel with all their simple sorrows, and find a pleasure in all their simple joys, remembering her own child-life, and the happy summer days.</p></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001599": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001599",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001600": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001600",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\"><h5>THE END</h5></div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001601": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001601",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"chapter\">\n</div></div>"
        },
        "$:/plugins/twpub/2d69726092dbb6a1/text/000001602": {
            "role": "text",
            "title": "$:/plugins/twpub/2d69726092dbb6a1/text/000001602",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"c10\">*** END OF THE PROJECT GUTENBERG EBOOK ALICE’S ADVENTURES IN WONDERLAND ***</div></div>"
