            "text": "<div class=\"twpub-2d69726092dbb6a1-1e5f26 twpub-2d69726092dbb6a1-d31eec twpub-2d69726092dbb6a1-6b4cd0\"><div class=\"c2\">Professor Michael S. Hart was the originator of the Project Gutenberg™ concept of a library of electronic works that could be freely shared with anyone. For forty years, he produced and distributed Project Gutenberg™ eBooks with only a loose network of volunteer support.</div></div>"
